s.push(new K.R(p[6],p[2],"\u5c71\u706b\u8d32","\u3010\u539f\u6587\u3011 \u8d32\u2460\u3002\u4ea8\u3002\u5c0f\u5229\u6709\u6538\u5f80\u3002\n\u3010\u8bd1\u6587\u3011 \u8d32\u5366\uff1a\u901a\u8fbe\u3002\u6709\u6240\u5f80\u5219\u6709\u5c0f\u5229\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u8d32(b\xec)\uff0c\u5366\u540d\u3002\u672c\u5366\u4e3a\u5f02\u5366\u76f8\u53e0(\u79bb\u4e0b\u826e\u4e0a)\u3002\u672c\u5366\u4e0b\u5366\u4e3a\u79bb\uff0c\u79bb\u4e3a\u706b\uff0c\u4e0a\u5366\u4e3a\u826e\uff0c\u826e\u4e3a\u5c71\u3002\u5c71\u4e0b\u6709\u706b\uff0c\u4e00\u7247\u8273\u7ea2\uff0c\u82b1\u6728\u76f8\u6620\uff0c\u9526\u7ee3\u5982\u6587\u3002\u55bb\u7537\u5a5a\u5973\u5ac1\uff0c\u56fd\u653f\u5bb6\u5236\uff0c\u90fd\u6709\u4eea\u793c\u5236\u5ea6\uff0c\u6784\u6210\u4e86\u590d\u6742\u7684\u793e\u4f1a\u4eba\u6587\u5173\u7cfb\uff0c\u7528\u4ee5\u7ef4\u62a4\u73b0\u5b58\u7684\u793e\u4f1a\u79e9\u5e8f\u3002\u8fd9\u6b63\u662f\u6240\u8c13\u8d24\u5fb7\u541b\u5b50\u201c\u89c2\u4e4e\u5929\u6587\uff0c\u5bdf\u4e4e\u65f6\u53d8\u201d\u795e\u9053\u8bbe\u6559\u7684\u7ed3\u679c\u3002\u6240\u4ee5\u5366\u540d\u66f0\u8d32\u3002\u8d32\uff0c\u300a\u5e8f\u5366\u300b\uff1a\u201c\u9970\u4e5f\u3002\u201d\n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u8d32\uff0c\u4ea8\u3002\u67d4\u6765\u800c\u6587\u521a\uff0c\u6545\u4ea8\u3002\u5206\uff0c\u521a\u4e0a\u800c\u6587\u67d4\u2460\u3002\u6545\u4ee5\u201c\u5c0f\u5229\u6709\u6538\u5f80\u201d\uff0c\u521a\u67d4\u4ea4\u9519\u2461\uff0c\u5929\u6587\u4e5f\u3002\u6587\u660e\u4ee5\u6b62\uff0c\u4eba\u6587\u4e5f\u3002\u89c2\u4e4e\u5929\u6587\u4ee5\u5bdf\u65f6\u53d8\uff0c\u89c2\u4e4e\u4eba\u6587\u4ee5\u5316\u6210\u5929\u4e0b\u3002 \n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u8d32\uff0c\u901a\u8fbe\u3002\u6b64\u5366\u4e0b\u5366\u4e3a\u79bb\uff0c\u4e49\u4e3a\u9634\u67d4\uff0c\u4e0a\u5366\u4e3a\u826e\uff0c\u4e49\u4e3a\u9633\u521a\uff0c\u6240\u4ee5\u8bf4\u9634\u67d4\u6587\u9970\u9633\u521a\uff0c\u56e0\u6b64\u201c\u901a\u8fbe\u201d\u3002\u67d4\u3001\u521a\u5206\u5e03\uff0c\u521a\u4e3a\u4e3b\u800c\u67d4\u4e3a\u886c\uff0c\u6240\u4ee5\u8bf4\u201c\u6709\u6240\u5f80\u5219\u6709\u5c0f\u5229\u201d\u3002\u521a\u67d4\u4ea4\u9519\u6210\u6587\uff0c\u8fd9\u662f\u5929\u8c61\u3002\u793e\u4f1a\u5236\u5ea6\u3001\u98ce\u4fd7\u6559\u5316\u662f\u4eba\u4eec\u751f\u6d3b\u7684\u57fa\u7840\uff0c\u662f\u793e\u4f1a\u4eba\u6587\u73b0\u8c61\u3002\u89c2\u5bdf\u5929\u8c61\uff0c\u5c31\u53ef\u4ee5\u5bdf\u89c9\u5230\u65f6\u5e8f\u7684\u53d8\u5316\u3002\u89c2\u5bdf\u793e\u4f1a\u4eba\u6587\u73b0\u8c61\uff0c\u5c31\u53ef\u4ee5\u7528\u6559\u5316\u6539\u9020\u6210\u5c31\u5929\u4e0b\u7684\u4eba\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u201c\u67d4\u6765\u800c\u6587\u521a\u201d\u56db\u53e5\uff0c\u6587\uff0c\u6587\u9970\u3002\u672c\u5366\u4e0b\u5366\u4e3a\u79bb\u4e3a\u67d4\uff0c\u4e0a\u5366\u4e3a\u826e\u4e3a\u521a\uff0c\u67d4\u5c45\u521a\u4e0b\uff0c\u4fef\u987a\u4e8e\u521a\uff0c\u6240\u4ee5\u8bf4\u201c\u67d4\u6765\u201d\uff0c\u201c\u521a\u4e0a\u201d\u3002\u201c\u6587\u521a\u201d\u3001\u201c\u6587\u67d4\u201d\uff0c\u5c31\u662f\u67d4\u521a\u4e92\u4e3a\u6587\u9970\uff0c\u5373\u4ee5\u4f26\u7406\u3001\u793c\u4eea\u6765\u89c4\u8303\u4eba\u4eec\u7684\u751f\u6d3b\uff0c\u7528\u5404\u79cd\u653f\u6cbb\u8bbe\u65bd\u6765\u7ef4\u62a4\u793e\u4f1a\u5236\u5ea6\u7684\u5c0a\u4e25\u3002\u2461\u4eca\u672c\u65e0\u201c\u521a\u7cb1\u4ea4\u9519\u201d\u56db\u5b57\u3002\u90ed\u4eac\u672c\u6709\u3002\u738b\u5f3c\u3001\u5b54\u9896\u8fbe\u6240\u636e\u672c\u4ea6\u6709\u3002\u4eca\u636e\u589e\u3002 \n\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u5c71\u4e0b\u6709\u706b\uff0c\u8d32\u3002\u541b\u5b50\u4ee5\u660e\u5eb6\u653f\u2460\uff0c\u65e0\u6562\u6298\u72f1\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u672c\u5366\u4e0a\u5366\u4e3a\u826e\u4e3a\u5c71\uff0c\u4e0b\u5366\u4e3a\u79bb\u4e3a\u706b\uff0c\u5c71\u4e0b\u6709\u706b\uff0c\u706b\u71ce\u7fa4\u5c71\uff0c\u8fd9\u662f\u8d32\u5366\u7684\u5366\u8c61\u3002\u541b\u5b50\u89c2\u6b64\u5366\u8c61\uff0c\u601d\u53ca\u731b\u706b\u71ce\u5c71\uff0c\u7389\u77f3\u4ff1\u711a\uff0c\u8349\u6728\u7686\u5c3d\uff0c\u4ee5\u6b64\u4e3a\u6212\uff0c\u4ece\u800c\u660e\u5bdf\u5404\u9879\u653f\u4e8b\uff0c\u4e0d\u6562\u4ee5\u5a01\u731b\u65ad\u72f1\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u5eb6\uff0c\u4f17\u3002\u5eb6\u653f\uff0c\u5404\u9879\u653f\u4e8b\u3002\n\n\u3010\u539f\u6587\u3011\n\u521d\u4e5d\uff1a\u8d32\u5176\u8dbe\u2460\uff0c\u820d\u8f66\u800c\u5f92\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u820d\u8f66\u800c\u5f92\uff0c\u4e49\u5f17\u4e58\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u4e5d\uff1a\u811a\u7a7f\u82b1\u978b\uff0c\u820d\u8f66\u4e0d\u4e58\uff0c\u5f92\u6b65\u800c\u884c\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u820d\u8f66\u4e0d\u4e58\uff0c\u5f92\u6b65\u800c\u884c\uff0c\u4e3a\u663e\u793a\u978b\u5b50\u4e4b\u7f8e\u4e3d\uff0c\u7406\u5e94\u4e0d\u4e58\u8f66\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8d32\uff0c\u6587\u9970\u3002\u8d32\u5176\u8dbe\uff0c\u72b9\u8a00\u7528\u82b1\u978b\u5957\u811a\u3002\u672c\u5366\u591a\u8bb0\u5f55\u5a5a\u5ac1\u4e4b\u4e8b\uff0c\u793c\u8058\u8fce\u5a36\u90fd\u6709\u751f\u52a8\u7684\u63cf\u5199\uff0c\u5c55\u73b0\u4e86\u5bf9\u5076\u5a5a\u5236\u7684\u7b80\u5355\u7684\u98ce\u4fd7\u56fe\u666f\u3002\u8bfb\u8005\u53ef\u4ece\u8fd9\u4e2a\u89d2\u5ea6\u4f53\u5bdf\u5404\u723b\u610f\u4e49\u3002\u300a\u8c61\u8f9e\u300b\u9644\u4f1a\u5927\u4e49\uff0c\u66f2\u52a0\u89e3\u91ca\uff0c\u4ee5\u81f4\u9762\u76ee\u5168\u975e\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e8c\uff1a\u8d32\u5176\u987b\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u8d32\u5176\u987b\uff0c\u4e0e\u4e0a\u5174\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e8c\uff1a\u4fee\u9970\u81ea\u5df1\u7684\u80e1\u987b\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u4fee\u9970\u81ea\u5df1\u7684\u80e1\u987b\uff0c\u8bf4\u660e\u8001\u4eba\u4e0d\u670d\u8001\uff0c\u5e2e\u52a9\u541b\u738b\u632f\u5174\u56fd\u5bb6\u3002\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e09\uff1a\u8d32\u5982\u6fe1\u5982\u2460\u3002\u6c38\u8d1e\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u6c38\u8d1e\u4e4b\u5409\uff0c\u7ec8\u83ab\u4e4b\u9675\u4e5f\u2461\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e09\uff1a\u5954\u8dd1\u5411\u524d\uff0c\u6c57\u6d41\u6d43\u80cc\u3002\u535c\u95ee\u957f\u65f6\u671f\u7684\u51f6\u5409\u800c\u5f97\u5409\u5146\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u6c38\u8fdc\u8d1e\u6b63\uff0c\u5fc5\u5409\u5229\uff0c\u56e0\u4e3a\u51b3\u6ca1\u6709\u4eba\u4fb5\u51cc\u6b63\u4eba\u541b\u5b50\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8d32\uff0c\u501f\u4e3a\u5954\u3002\u6fe1\uff0c\u6e7f\u3002\u5982\uff0c\u5f62\u5bb9\u8bcd\u8bcd\u5c3e\u3002\u2461\u300a\u8c61\u8f9e\u300b\u91ca\u201c\u8d1e\u201d\u4e3a\u8bda\u4fe1\u8d1e\u6b63\u3002\u9675\uff0c\u4fb5\u51cc\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u56db\uff1a\u8d32\u5982\u76a4\u5982\u2460\u3002\u767d\u9a6c\u7ff0\u5982\u2461\u3002\u532a\u5bc7\uff0c\u5a5a\u5abe\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u516d\u56db\uff0c\u5f53\u4f4d\u7591\u4e5f\u2462\u3002\u532a\u5bc7\uff0c\u5a5a\u5abe\uff0c\u7ec8\u65e0\u5c24\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011 \n\u516d\u56db\uff1a\u5954\u8dd1\u6c14\u5401\u5401\uff0c\u592a\u9633\u706b\u8fa3\u8fa3\u3002\u9ad8\u5934\u767d\u9a6c\uff0c\u5411\u524d\u98de\u5954\u3002\u4e0d\u662f\u6765\u62a2\u52ab\uff0c\u800c\u662f\u6765\u5a36\u4eb2\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u516d\u56db\u9634\u723b\u5c45\u9634\u4f4d\uff0c\u6240\u5904\u6070\u5f53\u3002\u65e2\u77e5\u4e0d\u662f\u6765\u62a2\u52ab\uff0c\u800c\u662f\u6765\u5a36\u4eb2\uff0c\u7591\u8651\u51b0\u91ca\uff0c\u7ec8\u65e0\u707e\u7978\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8d32\uff0c\u501f\u4e3a\u5954\u3002\u76a4(p\xf3\u5a46)\uff0c\u90d1\u7384\u672c\u4f5c\u71d4\uff0c\u711a\u70e7\uff0c\u8fd9\u91cc\u6307\u592a\u9633\u5f53\u5934\u6652\u3002\u2461\u7ff0\uff0c\u9ec4\u9896\u6ce8\uff1a\u201c\u9a6c\u4e3e\u5934\u9ad8\u6602\u4e5f\u3002\u201d\u9a6c\u5934\u9ad8\u4e3e\u5373\u98de\u5954\u4e4b\u72b6\u3002\u2462\u5f53\u4f4d\uff0c\u6b64\u4ee5\u516d\u56db\u723b\u4f4d\u723b\u8c61\u4e3a\u636e\u3002\u516d\u56db\uff0c\u9634\u723b\u5c45\u9634\u4f4d(\u7b2c\u56db\u4f4d\u4e3a\u9634\u4f4d)\uff0c\u662f\u4e3a\u5f53\u4f4d\u3002\u4e4b\u6240\u4ee5\u79f0\u201c\u7591\u201d\uff0c\u56e0\u4e3a\u770b\u5230\u5927\u6279\u4eba\u9a6c\u5954\u9a70\u800c\u6765\uff0c\u5fc3\u4e2d\u72af\u7591\uff0c\u96be\u6599\u5409\u51f6\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e94\uff1a\u8d32\u4e8e\u4e18\u56ed\uff0c\u675f\u5e1b\u620b\u620b\u2460\u3002\u541d\uff0c\u7ec8\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u516d\u4e94\u4e4b\u5409\uff0c\u6709\u559c\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e94\uff1a\u5954\u5411\u4e18\u56ed\uff0c\u9001\u4e0a\u8bb8\u591a\u5e03\u5e1b\uff0c\u521d\u9047\u56f0\u96be\uff0c\u7ec8\u5219\u987a\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u516d\u4e94\u723b\u8f9e\u8bf4\u7684\u5409\u5229\uff0c\u662f\u6307\u6709\u5a5a\u59fb\u4e4b\u559c\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u620b\u620b\uff0c\u9a6c\u878d\u6ce8\uff1a\u201c\u59d4\u79ef\u8c8c\u3002\u201d\u5373\u4e00\u5927\u5806\u7684\u6837\u5b50\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u4e5d\uff1a\u767d\u8d32\u2460\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u767d\u8d32\uff0c\u65e0\u548e\uff0c\u4e0a\u5f97\u5fd7\u4e5f\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8d32\uff0c\u9970\uff0c\u8fd9\u91cc\u6307\u914d\u8272\u3002\u767d\u8d32\uff0c\u72b9\u8a00\u767d\u5e95\u7684\u5e03\u5e1b\u9970\u4ee5\u5404\u82de\u82b1\u7eb9\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u4e5d\uff1a\u9001\u4e0a\u767d\u5e95\u9970\u4ee5\u8bf8\u8272\u82b1\u7eb9\u7684\u5e03\u5e1b\uff0c\u4e0d\u4f1a\u574f\u4e8b\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u767d\u5e95\u7684\u5e03\u5e1b\u9970\u4ee5\u8bf8\u8272\u82b1\u7eb9\uff0c\u6ca1\u6709\u707e\u7978\uff0c\u56e0\u4e3a\u4e0a\u4e5d\u5c45\u4e00\u5366\u4e5e\u9996\u4f4d\uff0c\u50cf\u4eba\u9ad8\u9ad8\u5728\u4e0a\uff0c\u5fd7\u5f97\u610f\u6ee1\u3002\n    "))
s.push(new K.R(p[6],p[7],"\u5c71\u5730\u5265","\u3010\u539f\u6587\u3011 \u5265\u2460\uff1a\u4e0d\u5229\u6709\u6538\u5f80\u3002\n\u3010\u8bd1\u6587\u3011 \u5265\u5366\uff1a\u6709\u6240\u5f80\u5219\u4e0d\u5229\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u5265\uff0c\u5366\u540d?\u672c\u5366\u662f\u5f02\u5366\u76f8\u53e0(\u5764\u4e0b\u826e\u4e0a)\u3002\u672c\u5366\u4e0a\u5366\u4e3a\u826e\uff0c\u826e\u4e3a\u5c71\uff0c\u4e0b\u5366\u4e3a\u5764\uff0c\u5764\u4e3a\u5730\u3002\u9ad8\u5c71\u5c79\u7acb\u4e8e\u5927\u5730\uff0c\u98ce\u96e8\u4fb5\u8680\uff0c\u5c71\u77f3\u5265\u843d\u3002\u8b66\u8beb\u541b\u738b\u63d0\u9632\u5c0f\u4eba\u4e0e\u653f\uff0c\u4fb5\u51cc\u541b\u5b50\uff0c\u5265\u8680\u56fd\u5bb6\u3002\u6240\u4ee5\u5366\u540d\u66f0\u5265\u3002\u5265\uff0c\u300a\u91ca\u6587\u300b\u5f15\u9a6c\u4e91\uff1a\u201c\u843d\u4e5f\u3002\u201d\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u5265\uff0c\u5265\u4e5f\uff0c\u67d4\u53d8\u521a\u4e5f\u2460\u3002\u201c\u4e0d\u5229\u6709\u6538\u5f80\u201d\uff0c\u5c0f\u4eba\u957f\u4e5f\u3002\u987a\u800c\u6b62\u4e4b\uff0c\u89c2\u8c61\u4e5f\u2461\u3002\u541b\u5b50\u5c1a\u6d88\u606f\u76c8\u865a\u2462\uff0c\u5929\u884c\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u5265\uff0c \u5265\u843d\uff0c\u610f\u601d\u662f\u9634\u67d4\u592a\u76db\uff0c\u4f7f\u9633\u521a\u5265\u843d\u3002\u201c\u6709\u6240\u5f80\u5219\u4e0d\u5229\u201d\uff0c\u56e0\u4e3a\u723b\u8c61\u8868\u660e\u5c0f\u4eba\u52bf\u529b\u6b63\u5f3a\u3002\u4e0b\u5366\u4e3a\u5764\uff0c\u4e49\u4e3a\u987a\uff0c\u4e0a\u5366\u4e3a\u826e\uff0c\u4e49\u4e3a\u6b62\uff0c\u59d4\u66f2\u6c42\u5168\uff0c\u9759\u6b62\u65e0\u4e3a\uff0c\u8fd9\u662f\u89c2\u5bdf\u5f62\u52bf\u4f5c\u51fa\u7684\u7ed3\u8bba\u3002\u541b\u5b50\u5e94\u8be5\u9075\u5faa\u6d88\u957f\u76c8\u865a\u7684\u89c4\u5f8b\uff0c\u56e0\u4e3a\u8fd9\u662f\u5929\u9053\u3002 \n\u3010\u6ce8\u91ca\u3011 \u2460\u67d4\u53d8\u521a\uff0c\u672c\u5366\u4e94\u9634\u723b\u5728\u4e0b\uff0c\u4e00\u9633\u723b\u5728\u4e0a\uff0c\u662f\u9634\u67d4\u592a\u76db\uff0c\u8db3\u4ee5\u538b\u5012\u9633\u521a\u3002\u2461\u8c61\uff0c\u5366\u8c61\u6240\u663e\u793a\u7684\u607f\u4e49\u3002\u2462\u5c1a\uff0c\u9075\u5faa\uff0c\u5c0a\u5c1a\u3002\u6d88\uff0c\u6d88\u6563\uff0c\u6d88\u4ea1\u3002\u606f\uff0c\u751f\u957f\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u5c71\u9644\u4e8e\u5730\uff0c\u5265\u3002\u4e0a\u4ee5\u539a\u4e0b\u5b89\u5b85\u2460\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u672c\u5366\u4e0a\u5366\u4e3a\u826e\u4e3a\u5c71\uff0c\u4e0b\u5366\u4e3a\u5764\u4e3a\u5730\uff0c\u5c71\u5728\u5730\u4e0a\uff0c\u98ce\u96e8\u5265\u8680\uff0c\u8fd9\u662f\u5265\u5366\u7684\u5366\u8c61\u3002\u541b\u5b50\u89c2\u6b64\u5366\u8c61\uff0c\u4ee5\u5c71\u77f3\u5265\u843d\uff0c\u5ca9\u89d2\u5d29\u584c\u4e3a\u6212\uff0c\u4ece\u800c\u539a\u7ed3\u6c11\u5fc3\uff0c\u4f7f\u4eba\u6c11\u5b89\u5c45\u4e50\u4e1a\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u4e0b\uff0c\u6307\u5eb6\u6c11\u767e\u59d3\u3002\u539a\u4e0b\uff0c\u72b9\u8a00\u539a\u7ed3\u6c11\u5fc3\u3002\u5b89\u5b85\uff0c\u72b9\u8a00\u5b89\u5c45\u3002\n\n\u3010\u539f\u6587\u3011\n\u521d\u516d\uff1a\u5265\u5e8a\u4ee5\u8db3\u2460\u3002\u8511\u8d1e\u2461\uff0c\u51f6\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5265\u5e8a\u4ee5\u8db3\uff0c\u4ee5\u706d\u4e0b\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u516d\uff1a\u5e8a\u8db3\u8131\u843d\u3002\u65e0\u987b\u5360\u95ee\uff0c\u8fd9\u662f\u51f6\u9669\u4e4b\u8c61\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5e8a\u8db3\u8131\u843d\uff0c\u8fd9\u662f\u81ea\u6bc1\u6839\u57fa\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u5265\uff0c\u8131\u843d\u3002\u5265\u5e8a\u4ee5\u8db3\uff0c\u738b\u5f3c\u6ce8\uff1a\u201c\u72b9\u4e91\u527f\u5e8a\u4e4b\u8db3\u4e5f\u3002\u201d\u2461\u8511\uff0c\u300a\u91ca\u6587\u300b\u5f15\u9a6c\u4e91\uff1a\u201c\u8511\uff0c\u65e0\u4e5f\u3002\u201d\u8511\u8d1e\uff0c\u72b9\u8a00\u65e0\u987b\u535c\u95ee\u3002\u6216\u8bfb\u8511\u4e3a\u68a6\uff0c\u8511\u8d1e\uff0c\u68a6\u4e4b\u5360\u95ee\u3002\u8bd1\u6587\u4e0d\u53d6\u3002\u6b64\u723b\u201c\u5265\u5e8a\u4ee5\u8db3\u201d\u53ca\u516d\u4e8c\u201c\u5265\u5e8a\u4ee5\u8fa8\u201d\uff0c\u516d\u56db\u201c\u5265\u5e8a\u4ee5\u80a4\u201d\u7686\u4e3a\u8c61\u5360\u4e4b\u8f9e\uff0c\u5373\u8fd9\u79cd\u73b0\u8c61\u7686\u68a6\u4e2d\u6240\u89c1\uff0c\u4e3a\u5176\u5f02\u5e38\uff0c\u6545\u62c8\u84cd\u4ee5\u5360\u5176\u51f6\u5409\u3002 \n\n\u3010\u539f\u6587\u3011\n\u516d\u4e8c\uff1a\u5265\u5e8a\u4ee5\u8fa8\uff0c\u8511\u8d1e\uff0c\u51f6\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5265\u5e8a\u4ee5\u8fa8\uff0c\u672a\u6709\u4e0e\u4e5f\u2461\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e8c\uff1a\u5e8a\u677f\u8131\u843d\u3002\u65e0\u987b\u5360\u95ee\uff0c\u8fd9\u662f\u51f6\u9669\u4e4b\u8c61\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5e8a\u677f\u8131\u843d\uff0c\u8fd9\u662f\u81ea\u6bc1\u8f85\u4f50\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8fa8\uff0c\u9ad8\u4ea8\u8bf4\uff1a\u201c\u8fa8\u8bfb\u4e3a\u7251\uff0c\u5e8a\u677f\u4e5f\u3002\u201d\u4f59\u540c\u521d\u516d\u723b\u8f9e\u3002\u2461\u4e0e\uff0c\u52a9\uff0c\u8f85\u4f50\u3002\n\n\u3010\u539f\u6587\u3011 \n\u516d\u4e09\uff1a\u5265\u4e4b\u2460\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5265\u4e4b\u65e0\u548e\uff0c\u5931\u4e0a\u4e0b\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e09\uff1a\u5272\u53d6\u90bb\u56fd\u90bb\u9091\u7684\u571f\u5730\u4eba\u6c11\uff0c\u53ef\u4ee5\u65e0\u707e\u7978\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5272\u53d6\u90bb\u56fd\u90bb\u9091\u7684\u571f\u5730\u4eba\u6c11\uff0c\u53ef\u4ee5\u65e0\u707e\u7978\uff0c\u56e0\u4e3a\u90bb\u56fd\u90bb\u9091\u7684\u7edf\u6cbb\u8005\u5df2\u5931\u53bb\u4e86\u4e0a\u4e0b\u81e3\u6c11\u7684\u652f\u6301\u3002 \n\u3010\u6ce8\u91ca\u3011\n\u2460\u4e4b\uff0c\u72b9\u8a00\u4ed6\uff0c\u6cdb\u6307\u4ee3\u8bc3\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u56db\uff1a\u5265\u5e8a\u4ee5\u80a4\uff0c\u51f6\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5265\u5e8a\u4ee5\u80a4\uff0c\u5207\u8fd1\u707e\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u56db\uff1a\u5265\u53d6\u5e8a\u4e0a\u7684\u57ab\u5e2d\uff0c\u8fd9\u662f\u51f6\u9669\u4e4b\u8c61\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5265\u53d6\u5e8a\u4e0a\u7684\u57ab\u5e2d\uff0c\u707e\u7978\u5c31\u5728\u773c\u524d\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u80a4\uff0c\u9ad8\u4ea8\u8bf4\uff1a\u201c\u80a4\uff0c\u5e2d\u4e5f\u3002\u201d\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e94\uff1a\u8d2f\u9c7c\u4ee5\u5bab\u4eba\u5ba0\u2460\uff0c\u65e0\u4e0d\u5229\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4ee5\u5bab\u4eba\u5ba0\uff0c\u7ec8\u65e0\u5c24\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e94\uff1a\u5bab\u4eba\u4f9d\u6b21\u5f53\u5915\u53d7\u5ba0\uff0c\u65e0\u6240\u4e0d\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5bab\u4eba\u4f9d\u6b21\u5f53\u5915\u53d7\u5ba0\uff0c\u79e9\u5e8f\u4e0d\u4e71\uff0c\u539a\u8584\u5747\u5300\uff0c\u56e0\u800c\u7ec8\u65e0\u5fe7\u60a3\u3002 \n\u3010\u6ce8\u91ca\u3011\n\u2460\u8d2f\u9c7c\uff0c\u72b9\u4eca\u8a00\u9c7c\u8d2f\uff0c\u4f9d\u6b21\u800c\u8fdb\u4e4b\u610f\u3002\u5ba0\uff0c\u5ba0\u7231\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u4e5d\uff1a\u7855\u679c\u4e0d\u98df\uff0c\u541b\u5b50\u5f97\u8206\uff0c\u5c0f\u4eba\u5265\u5e90\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u541b\u5b50\u5f97\u8206\uff0c\u6c11\u6240\u8f7d\u4e5f\u3002\u5c0f\u4eba\u5265\u5e90\uff0c\u7ec8\u4e0d\u53ef\u7528\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u4e5d\uff1a\u52b3\u8005\u4e0d\u5f97\u98df\uff0c\u4e0d\u52b3\u8005\u5f97\u98df\uff1b\u541b\u5b50\u4e58\u5750\u534e\u4e3d\u7684\u8f66\u5b50\uff0c\u5c0f\u4eba\u7684\u8349\u5c4b\u4e0d\u853d\u98ce\u96e8\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u541b\u5b50\u4e58\u5750\u534e\u4e3d\u7684\u8f66\u8f86\uff0c\u8fd9\u662f\u8001\u767e\u59d3\u6c89\u91cd\u7684\u8d1f\u62c5\u3002\u5c0f\u4eba\u7684\u7834\u5c4b\u4e0d\u853d\u98ce\u96e8\uff0c\u8fd9\u79cd\u53d6\u8c61\u8868\u660e\u7ec8\u7a76\u96be\u4fdd\u5e73\u5b89\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u5e90\uff0c\u8349\u623f\u3002\u526f\uff0c\u7834\u70c2\u3002\n    "))
s.push(new K.R(p[7],p[3],"\u5730\u96f7\u590d","\u3010\u539f\u6587\u3011 \u590d\u2460\uff1a\u4ea8\u3002\u51fa\u5165\u65e0\u75be\u3002\u670b\u6765\u65e0\u548e\u2461\u3002\u53cd\u590d\u5176\u9053\uff0c\u4e03\u65e5\u6765\u590d\u3002\u5229\u6709\u6538\u5f80\u3002\n\u3010\u8bd1\u6587\u3011 \u590d\u5366\uff1a\u901a\u6cf0\u3002\u51fa\u95e8\u3001\u5c45\u5904\u5747\u65e0\u75be\u75c5\u3002\u6709\u94b1\u53ef\u8d5a\u800c\u53ef\u4ee5\u65e0\u707e\u7978\u3002\u5f80\u8fd4\u9014\u4e2d\uff0c\u4e03\u65e5\u53ef\u5f52\u3002\u6709\u6240\u5f80\u5219\u6709\u6240\u5229\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u590d\uff0c\u5366\u540d\uff1a\u672c\u5366\u4e3a\u5f02\u5366\u76f8\u53e0(\u9707\u4e0b\u5764\u4e0a)\u3002\u672c\u5366\u5916\u5366\u4e3a\u5764\uff0c\u5764\u4e3a\u9634\u4e3a\u987a\uff0c\u5185\u5366\u4e3a\u9707\uff0c\u9707\u4e3a\u9633\u4e3a\u52a8\u3002\u5185\u9633\u5916\u9634\uff0c\u5faa\u5e8f\u8fd0\u52a8\uff0c\u5f80\u8fd4\u65e0\u7a77\uff0c\u6240\u4ee5\u5366\u540d\u66f0\u590d\u3002\u590d\uff0c\u300a\u8bf4\u6587\u300b\uff1a\u201c\u5f80\u6765\u4e5f\u3002\u201d\u2461\u670b\uff0c\u670b\u8d1d\uff0c\u5373\u94b1\u5e01\u3002\u670b\u6765\uff0c\u6709\u94b1\u53ef\u8d5a\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u590d\uff0c\u4ea8\uff0c\u521a\u53cd\u2460\u3002\u52a8\u800c\u4ee5\u987a\u884c\uff0c\u662f\u4ee5\u201c\u51fa\u5165\u65e0\u75be\uff0c\u670b\u6765\u65e0\u548e\u201d\u2461\u3002\u201c\u53cd\u590d\u5176\u9053\uff0c\u4e03\u65e5\u6765\u590d\u201d\uff0c\u5929\u884c\u4e5f\u2462\u3002\u201c\u5229\u6709\u6538\u5f80\u201d\uff0c\u521a\u957f\u4e5f\u2463\u3002\u590d\uff0c\u5176\u89c1\u5929\u5730\u4e4b\u5fc3\u4e4e!\n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u590d\uff0c\u901a\u6cf0\u3002\u56e0\u4e3a\u5185\u5366\u4e3a\u9707\u4e3a\u9633\uff0c\u5916\u5366\u4e3a\u5764\u4e3a\u9634\uff0c\u9633\u521a\u8fd4\u590d\u4e8e\u5185\uff0c\u6240\u4ee5\u5366\u540d\u66f0\u590d\u3002\u4e00\u5207\u4e3e\u52a8\u7b26\u5408\u6b63\u9053\uff0c\u65e0\u5f80\u800c\u4e0d\u987a\u5229\uff0c\u6240\u4ee5\u201c\u51fa\u95e8\u3001\u5c45\u5904\u5747\u65e0\u75be\u75c5\uff0c\u53c8\u6709\u53cb\u4eba\u76f8\u52a9\uff0c\u53ef\u4ee5\u65e0\u707e\u7978\u201d\u3002\u201c\u53cd\u590d\u5faa\u73af\uff0c\u81f3\u4e03\u5219\u4e3a\u4e00\u5468\u671f\u201d\uff0c\u8fd9\u662f\u5929\u7684\u539f\u5219\u3002\u201c\u6709\u6240\u5f80\u5219\u6709\u6240\u5229\u201d\uff0c\u56e0\u4e3a\u521d\u723b\u4e3a\u9633\u723b\uff0c\u8868\u660e\u9633\u521a\u5df2\u6e10\u751f\u957f\u3002\u590d\u5366\u7684\u5366\u8c61\uff0c\u4f53\u73b0\u4e86\u5929\u5730\u8fd0\u884c\u7684\u5b9e\u8d28\u6027\u89c4\u5f8b\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u53cd\uff0c\u540c\u8fd4\uff0c\u72b9\u8a00\u9633\u521a\u4e8e\u5185\u3002\u2461\u670b\uff0c\u300a\u5f56\u8f9e\u300b\u91ca\u670b\u4e3a\u670b\u53cb\u4e4b\u670b\uff0c\u4e0e\u7ecf\u610f\u6709\u522b\u3002\u2462\u4e03\u65e5\u6765\u590d\uff0c\u300a\u6613\u300b\u7ecf\u3001\u4f20\u4f5c\u8005\u90fd\u8ba4\u4e3a\u201c\u4e03\u201d\u662f\u5929\u5730\u5faa\u73af\u7684\u5468\u671f\u3002\u9634\u9633\u4e4b\u6c14\uff0c\u81f3\u4e03\u4e2a\u6708\u5219\u4e92\u76f8\u6362\u4f4d\uff0c\u6613\u723b\u81f3\u7b2c\u4e03\u723b\u5219\u590d\u539f\u7b49\uff0c\u8fd9\u662f\u5929\u7684\u8fd0\u884c\u539f\u5219\u3002\u2463\u521a\u957f\uff0c\u6b64\u4ee5\u521d\u4e5d\u723b\u8c61\u4e3a\u636e\uff0c\u672c\u5366\u4e0a\u4e94\u723b\u4e3a\u9634\u723b\uff0c\u552f\u521d\u723b\u4e3a\u9633\u723b\uff0c\u300a\u5f56\u8f9e\u300b\u8ba4\u4e3a\u8fd9\u662f\u9633\u521a\u840c\u751f\u53d1\u5c55\u4e4b\u72b6\u3002 \n\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u96f7\u5728\u5730\u4e2d\u2460\uff0c\u590d\u3002\u5148\u738b\u4ee5\u81f3\u65e5\u95ed\u5173\u2461\uff0c \u5546\u65c5\u4e0d\u884c\uff0c\u540e\u4e0d\u7701\u65b9\u2462\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u672c\u5366\u5185\u5366\u4e3a\u9707\u4e3a\u96f7\uff0c\u5916\u5366\u4e3a\u5764\u4e3a\u5730\uff0c\u5929\u5bd2\u5730\u51bb\uff0c\u96f7\u8fd4\u5f52\u5730\u4e2d\uff0c\u5f80\u800c\u6709\u590d\uff0c\u4f9d\u65f6\u56de\u5f52\uff0c\u8fd9\u662f\u590d\u5366\u7684\u5366\u8c61\u3002\u5148\u738b\u89c2\u6b64\u5366\u8c61\uff0c\u53d6\u6cd5\u4e8e\u96f7\uff0c\u5728\u51ac\u81f3\u4e4b\u65e5\u5173\u95ed\u57ce\u95e8\uff0c\u4e0d\u63a5\u7eb3\u5546\u65c5\uff0c\u541b\u738b\u4e5f\u4e0d\u5de1\u89c6\u90a6\u56fd\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u96f7\u5728\u5730\u4e2d\uff0c\u53e4\u4eba\u8ba4\u4e3a\u5929\u5bd2\u4e4b\u65f6\uff0c\u96f7\u8fd4\u5f52\u5730\u4e2d\uff0c\u6c89\u5bc2\u65e0\u58f0\uff0c\u4e07\u7269\u86f0\u4f0f\u3002\u2461\u81f3\u65e5\uff0c\u51ac\u81f3\u4e4b\u65e5\u3002\u5173\uff0c\u57ce\u5173\u3002\u95ed\u5173\uff0c\u5173\u95ed\u57ce\u95e8\u3002\u2462\u540e\uff0c\u541b\u738b\u3002\u7701\uff0c\u5de1\u89c6\u3002\u65b9\uff0c\u90a6\u56fd\u3002 \n\u3010\u539f\u6587\u3011\n\u521d\u4e5d\uff1a\u4e0d\u8fdc\u590d\uff0c\u65e0\u7947\u6094\u2460\uff0c\u5143\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4e0d\u8fdc\u4e4b\u590d\uff0c\u4ee5\u8129\u8eab\u4e5f\u2461\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u4e5d\uff1a\u51fa\u5916\u4e0d\u8fdc\u5c31\u8fd4\u56de\uff0c\u6ca1\u6709\u5927\u7684\u8fc7\u5931\uff0c\u5927\u5409\u5927\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u51fa\u5916\u4e0d\u8fdc\u5c31\u8fd4\u56de\uff0c\u6bd4\u55bb\u80fd\u65f6\u65f6\u53cd\u7701\uff0c\u4e25\u4e8e\u4fee\u8eab\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u4e0d\u8fdc\u590d\uff0c\u72b9\u8a00\u6ca1\u8d70\u591a\u8fdc\u5c31\u56de\u5f52\u3002\u7957\uff0c\u5927\u3002\u672c\u5366\u591a\u535c\u65c5\u884c\u4e4b\u4e8b\uff0c\u4e8b\u6781\u7b80\u5355\uff0c\u8bed\u6781\u6734\u7d20\u3002\u300a\u8c61\u8f9e\u300b\u4ee5\u201c\u4fee\u8eab\u201d\u3001\u201c\u4e0b\u4ec1\u201d\u3001\u201c\u4ece\u9053\u201d\u7b49\u5112\u5bb6\u7684\u4f26\u7406\u89c2\u5ff5\u8fdb\u884c\u89e3\u91ca\uff0e\u663e\u7cfb\u7275\u5f3a\u3002\u8bfb\u8005\u7ec6\u8bfb\u6587\u4e49\uff0c\u4e0d\u96be\u8fa8\u6790\u3002\u2461\u8129\uff0c\u501f\u4e3a\u4fee\u3002\u300a\u96c6\u89e3\u300b\u672c\u4f5c\u4fee\u3002\u4fee\uff0c\u6cbb\u7406\u3002 \n\n\u3010\u539f\u6587\u3011\n\u516d\u4e8c\uff1a\u4f11\u590d\u2460\uff0c\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4f11\u590d\u4e4b\u5409\uff0c\u4ee5\u4e0b\u4ec1\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e8c\uff1a\u5706\u6ee1\u800c\u5f52\uff0c\u5409\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5706\u6ee1\u800c\u5f52\u4e4b\u6240\u4ee5\u5409\u5229\uff0c\u662f\u80fd\u591f\u53bb\u4f4d\u8ba9\u8d24\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u4f11\uff0c\u7f8e\u3002\u4f11\u590d\uff0c\u6307\u5706\u6ee1\u800c\u5f52\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e09\uff1a\u9891\u590d\u2460\uff0c\u5389\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u9891\u590d\u4e4b\u5389\uff0c\u4e49\u65e0\u548e\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e09\uff1a\u6101\u7709\u82e6\u8138\u5730\u56de\u6765\uff0c\u662f\u9047\u5230\u4e86\u5371\u9669\uff0c\u77e5\u96be\u800c\u9000\u53ef\u4ee5\u65e0\u707e\u7978\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u867d\u7136\u6101\u7709\u82e6\u8138\u5730\u56de\u6765\uff0c\u4f46\u5df2\u8131\u79bb\u5371\u9669\uff0c\u7406\u5e94\u6ca1\u6709\u707e\u7978\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u9891\uff0c\u501f\u4e3a\u98a6\uff0c\u5373\u76b1\u7709\u5934\u3002 \n\n\u3010\u539f\u6587\u3011\n\u516d\u56db\uff1a\u4e2d\u884c\u72ec\u590d\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4e2d\u884c\u72ec\u590d\uff0c\u4ee5\u4ece\u9053\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u56db\uff1a\u4e2d\u9014\u72ec\u81ea\u8fd4\u56de\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u4e2d\u9014\u72ec\u81ea\u8fd4\u56de\uff0c\u8fd9\u662f\u8fd4\u56de\u5230\u9053\u4e49\u4e0a\u6765\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u4e2d\u884c\uff0c\u4e2d\u9014\u3002\u534a\u8def\u3002\u72ec\uff0c\u72ec\u81ea\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e94\uff1a\u6566\u590d\uff0c\u65e0\u6094\u2460\u3002\n\u300a\u8c61\u300b\u65e5\uff1a\u6566\u590d\u65e0\u6094\uff0c\u4e2d\u4ee5\u81ea\u8003\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e94\uff1a\u7ecf\u8fc7\u8003\u5bdf\uff0c\u51b3\u5b9a\u8fd4\u56de\uff0c\u53ef\u4ee5\u65e0\u6094\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u7ecf\u8fc7\u8003\u5bdf\uff0c\u51b3\u5b9a\u8fd4\u56de\uff0c\u53ef\u4ee5\u65e0\u6094\uff0c\u610f\u601d\u662f\u4ece\u5185\u5fc3\u7528\u6b63\u9053\u68c0\u5bdf\u81ea\u5df1\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u6566\uff0c\u9ad8\u4ea8\u8bf4\uff1a\u201c\u8003\u5bdf\u4e5f\u3002\u201d\u5e76\u5f15\u300a\u5b5f\u5b50?\u516c\u5b59\u4e11\u300b\u4e0b\u7bc7\uff1a\u201c\u4f7f\u865e\u6566\u5320\u3002\u201d\u300a\u8340\u5b50?\u8363\u8fb1\u7bc7\u300b\uff1a\u201c\u4ee5\u6566\u6bd4\u5176\u4e8b\u3002\u201d\u300a\u7586\u56fd\u7bc7\u300b\uff1a\u201c\u5219\u5e38\u4e0d\u80dc\u592b\u6566\u6bd4\u5c0f\u4e8b\u8005\u77e3\u3002\u201d\u66f0\uff1a\u201c\u6566\uff0c\u7686\u8003\u5bdf\u4e4b\u4e49\u3002\u201d\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u516d\uff1a\u8ff7\u590d\uff0c\u51f6\uff0c\u6709\u707e\u771a\u2460\u3002\u7528\u884c\u5e08\uff0c\u7ec8\u6709\u5927\u8d25\uff0c\u4ee5\u5176\u56fd\u541b\u51f6\u2461\u3002\u81f3\u4e8e\u5341\u5e74\u4e0d\u514b\u5f81\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u8ff7\u590d\u4e4b\u51f6\uff0c\u53cd\u541b\u9053\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u516d\uff1a\u8ff7\u9014\u96be\u8fd4\uff0c\u51f6\u9669\uff0c\u6709\u707e\u7978\u3002\u7b6e\u9047\u6b64\u723b\uff0c\u51fa\u5175\u6253\u4ed7\uff0c\u7ec8\u6709\u5927\u8d25\uff0c\u8fde\u7d2f\u56fd\u541b\u906d\u9047\u51f6\u9669\uff0c\u5143\u6c14\u5927\u4f24\uff0c\u5341\u5e74\u540e\u8fd8\u4e0d\u80fd\u518d\u4e3e\u5f81\u4f10\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u8ff7\u9014\u96be\u8fd4\u906d\u9047\u51f6\u9669\uff0c\u8fd9\u662f\u7531\u4e8e\u541b\u738b\u8fdd\u53cd\u541b\u9053\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u771a(sh\u011bng\u7701)\uff0c\u707e\u7978\u3002\u2461\u4ee5\uff0c\u53ca\u3002\u7528\u5982\u52a8\u8bcd\uff0c\u72b9\u4eca\u8a00\u8fde\u7d2f\u3002\n    "))
s.push(new K.R(p[0],p[3],"\u5929\u96f7\u65e0\u5984","\u3010\u539f\u6587\u3011 \u65e0\u5984\u2460\uff1a\u5143\u4ea8\uff0c\u5229\u8d1e\u3002\u5176\u532a\u6b63\uff0c\u6709\u771a\uff0c\u4e0d\u5229\u6709\u6538\u5f80\u3002\n\u3010\u8bd1\u6587\u3011 \u65e0\u5984\u5366\uff1a\u5609\u7f8e\u901a\u6cf0\uff0c\u535c\u95ee\u5f97\u5409\u5146\u3002\u884c\u4e3a\u4e0d\u6b63\u5f53\uff0c\u5219\u6709\u707e\u6b83\uff0c\u6709\u6240\u5f80\u5219\u4e0d\u5229\u3002\n\u3010\u6c6a\u91ca\u3011 \u2460\u65e0\u5984\uff0c\u5366\u540d\u3002\u672c\u5366\u4e3a\u5f02\u5366\u76f8\u53e0(\u9707\u4e0b\u4e7e\u4e0a)\u3002\u4e0a\u5366\u4e3a\u4e15\u4e15\u4e7e\uff0c\u4e7e\u4e3a\u5929\u4e3a\u521a\u4e3a\u5065\uff0c\u4e0b\u5366\u4e3a\u9707\uff0c\u9707\u4e3a\u96f7\u4e3a\u521a\u4e3a\u52a8\u3002\u52a8\u5065\u76f8\u8f85\uff0c\u9633\u521a\u5145\u6c9b\uff0c\u5929\u7a7a\u9e23\u96f7\uff0c\u9707\u52a8\u4e07\u7269\uff0c\u4eba\u5fc3\u632f\u594b\uff0c\u5927\u6709\u4f5c\u4e3a\u3002\u4f46\u987b\u9075\u5faa\u6b63\u9053\uff0c\u4e0d\u53ef\u5984\u884c\u3002\u6240\u4ee5\u5366\u540d\u66f0\u65e0\u5984\u3002\u65e0\u5984\uff0c\u300a\u8bf4\u6587\u300b\uff1a\u201c\u5984\uff0c\u4e71\u4e5f\u3002\u201d\u65e0\u5984\uff0c\u4e0d\u53ef\u5984\u884c\u975e\u6b63\u4e4b\u610f\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u65e0\u5984\u3002\u521a\u81ea\u5916\u6765\u800c\u4e3a\u4e3b\u4e8e\u5185\u2460\u3002\u52a8\u800c\u5065\uff0c\u521a\u4e2d\u800c\u5e94\u3002\u5927\uff0c\u4ea8\u4ee5\u6b63\uff0c\u5929\u4e4b\u547d\u4e5f\u3002\u201c\u5176\u532a\u6b63\uff0c\u6709\u771a\uff0c\u4e0d\u5229\u6709\u6538\u5f80\u3002\u201d\u65e0\u5984\u4e4b\u5f80\u4f55\u4e4b\u77e3?\u5929\u547d\u4e0d\u7950\uff0c\u884c\u77e3\u54c9?\n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u65e0\u5984\uff0c\u5916\u5366\u4e3a\u4e7e\u4e3a\u9633\uff0c\u9633\u521a\u4e4b\u8c61\u81ea\u5916\u800c\u6765\uff0c\u6e10\u4fb5\u5165\u5185\uff1b\u5185\u5366\u4e3a\u9707\uff0c\u521d\u723b\u4e3a\u9633\uff0c\u4ee5\u521d\u723b\u4e3a\u4e3b\u800c\u5b9a\u9707\u5366\u7684\u6027\u8d28\u3002\u4e0b\u5366\u4e3a\u9707\uff0c\u4e49\u4e3a\u52a8\uff0c\u4e0a\u5366\u4e3a\u4e7e\uff0c\u4e49\u4e3a\u5065\uff0c\u6240\u4ee5\u8bf4\u65e0\u5984\u4e4b\u5366\u5177\u6709\u201c\u52a8\u800c\u5065\u201d\u7684\u54c1\u5fb7\u3002\u4e5d\u4e94\u9633\u723b\u5c45\u4e0a\u5366\u4e2d\u4f4d\uff0c\u6709\u521a\u4e2d\u4e4b\u8c61\uff0c\u516d\u4e8c\u9634\u723b\u5c45\u4e0b\u5366\u4e2d\u4f4d\uff0c\u5904\u548c\u5e94\u4e4b\u5730\u3002\u5143\u5927\u3001\u4ea8\u901a\u3001\u8d1e\u6b63\uff0c\u6b63\u662f\u5929\u547d\u6240\u5728\u3002\u201c\u884c\u4e3a\u4e0d\u6b63\u5f53\uff0c\u5219\u6709\u707e\u6b83\uff0c\u6709\u6240\u5f80\u5219\u4e0d\u5229\u201d\uff0c\u5c31\u662f\u8bf4\u5984\u884c\u975e\u6b63\u65e0\u8def\u53ef\u901a\u3002\u4e0a\u5929\u4e0d\u52a0\u4fdd\u7950\uff0c\u8fd8\u80fd\u884c\u5f97\u901a\u5417?\n\u3010\u6ce8\u91ca\u3011 \u2460\u201c\u521a\u81ea\u5916\u6765\u201d\u53e5\uff0c\u65e0\u5984\u4e4b\u5366\uff0c\u5916\u5366\u4e3a\u4e7e\uff0c\u4e7e\u4e3a\u7eaf\u9633\u7eaf\u521a\uff1b\u5185\u5366\u4e3a\u9707\uff0c\u521d\u723b\u4e3a\u9633\u4e3a\u521a\uff0c\u5185\u5366\u4e4b\u521a\u6765\u81ea\u5916\u5366\uff0c\u6240\u4ee5\u8bf4\u201c\u521a\u81ea\u5916\u6765\u3002\u201d\u53c8\uff0c\u6613\u5366\u901a\u4f8b\u9633\u5366(\u9707\u3001\u574e\u3001\u826e)\u4e3a\u4e00\u9633\u723b\u800c\u4e8c\u9634\u723b\uff0c\u9634\u5366(\u5dfd\u3001\u79bb\u3001\u5151)\u4e3a\u4e00\u9634\u723b\u4e8c\u9633\u723b\uff0c\u9634\u9633\u4e4b\u5206\u4ee5\u4e00\u723b\u4e3a\u5b9a\u3002\u9707\u4e4b\u4e3a\u9633\uff0c\u4ee5\u521d\u4e5d\u9633\u723b\u4e3a\u5b9a\u3002\u6b64\u4e3a\u4e3b\u723b\uff0c\u6240\u4ee5\u8bf4\u4e3a\u201c\u4e3b\u5b50\u5185\u201d\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u5929\u4e0b\u96f7\u884c\uff0c\u7269\u4e0e\u2460\uff0c\u65e0\u5984\u3002\u5148\u738b\u4ee5\u8302\u5bf9\u65f6\u80b2\u4e07\u7269\u2461\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u672c\u5366\u4e0a\u5366\u4e3a\u4e7e\u4e3a\u5929\uff0c\u4e0b\u5366\u4e3a\u9707\u4e3a\u96f7\uff0c\u5929\u5b87\u4e4b\u4e0b\uff0c\u6625\u96f7\u6eda\u52a8\uff0c\u4e07\u7269\u840c\u53d1\uff0c\u5b73\u751f\u7e41\u884d\uff0c\u8fd9\u662f\u65e0\u5984\u7684\u5366\u8c61\u3002\u5148\u738b\u89c2\u6b64\u5366\u8c61\uff0c\u4ece\u800c\u594b\u52c9\u52aa\u529b\uff0c\u987a\u5e94\u65f6\u4ee4\uff0c\u4fdd\u80b2\u4e07\u7269\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u4e0e\uff0c\u9ad8\u4ea8\u8ba4\u4e3a\uff1a\u201c\u8bfb\u4e3a\u8212\uff0c\u4f38\u5c55\u4e5f\u3002\u201d\u2461\u8302\uff0c\u9ad8\u4ea8\u8bf4\uff1a\u201c\u8bfb\u4e3a\u61cb\uff0c\u52c9\u4e5f\uff0c\u52aa\u529b\u4e5f\u3002\u201d\u5bf9\uff0c\u7126\u5faa\u8bf4\uff1a\u201c\u5bf9\uff0c\u72b9\u5e94\u4e5f\u3002\u201d\u5bf9\u65f6\uff0c\u72b9\u8a00\u987a\u5e94\u65f6\u4ee4\u3002\n\n\u3010\u539f\u6587\u3011\n\u521d\u4e5d\uff1a\u65e0\u5984\u5f80\uff0c\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u65e0\u5984\u4e4b\u5f80\uff0c\u5f97\u5fd7\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u4e5d\uff1a\u4e0d\u8981\u5984\u884c\u975e\u6b63\uff0c\u5409\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u6ca1\u6709\u6096\u5984\u7684\u884c\u4e3a\uff0c\u56e0\u4e3a\u6240\u6709\u884c\u52a8\u53d7\u5230\u610f\u5fd7\u7684\u63a7\u5236\u3002\n\u3010\u539f\u6587\u3011\n\u516d\u4e8c\uff1a\u4e0d\u8015\uff0c\u83b7\uff1b\u4e0d\u83d1\uff0c\u7572\u2460\u3002\u5219\u5229\u6709\u6538\u5f80?\n\u300a\u8c61\u300b\u66f0\uff1a\u4e0d\u8015\uff0c\u83b7\uff0c\u672a\u5bcc\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e8c\uff1a\u4e0d\u8015\u79cd\u5c31\u60f3\u6536\u83b7\uff0c\u4e0d\u5f00\u8352\u5730\u5c31\u60f3\u79cd\u719f\u5730\u3002\u8fd9\u4e9b\u5984\u8c2c\u7684\u884c\u5f84\u600e\u80fd\u6709\u5229?\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u4e0d\u8015\u79cd\u800c\u60f3\u6536\u83b7\uff0c\u8fd9\u79cd\u7a7a\u5984\u7684\u5ff5\u5934\u4e0d\u80fd\u5e26\u6765\u8d22\u5bcc\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u83d1\u3001\u7572\uff0c\u300a\u5c14\u96c5?\u91ca\u8bc2\u300b\uff1a\u201c\u7530\uff0c\u4e00\u5c81\u66f0\u83d1\uff0c\u4e8c\u5c81\u66f0\u65b0\u7530\uff0c\u4e09\u5c81\u65e5\u7572\u3002\u201d\u83d1\uff0c\u72b9\u8a00\u65b0\u5f00\u8352\u5730\u3002\u7572\uff0c\u719f\u5730\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e09\uff1a\u65e0\u5984\u4e4b\u707e\u2460\u3002\u6216\u7cfb\u4e4b\u725b\uff0c\u884c\u4eba\u4e4b\u5f97\uff0c\u9091\u4eba\u4e4b\u707e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u884c\u4eba\u5f97\u725b\uff0c\u9091\u4eba\u707e\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e09\uff1a\u610f\u5916\u7684\u707e\u96be\u3002\u6bd4\u55bb\u8bf4\u6709\u4eba\u5c06\u725b\u7cfb\u5728\u4e0d\u8be5\u7cfb\u7684\u5730\u65b9\uff0c\u884c\u4eba\u987a\u624b\u7275\u725b\u83b7\u610f\u5916\u4e4b\u5f97\uff0c\u9091\u4eba\u5931\u725b\u53d7\u5230\u610f\u5916\u4e4b\u707e\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u884c\u4eba\u610f\u5916\u5f97\u725b\uff0c\u9091\u4eba\u610f\u5916\u8499\u707e\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u5984\u3002\u300a\u91ca\u6587\u300b\u5f15\u9a6c\u3001\u90d1\u3001\u58ec\u8083\u7686\u4e91\uff1a\u201c\u72b9\u671b\u3002\u201d\u65e0\u5984\uff0c\u72b9\u4eca\u8a00\u6ca1\u6709\u60f3\u5230\u3002\u65e0\u5984\u4e4b\u707e\uff0c\u5373\u610f\u5916\u4e4b\u707e\u3002\n\n\u3010\u539f\u6587\u3011 \n\u4e5d\u56db\uff1a\u53ef\u8d1e\u2460\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u53ef\u8d1e\u65e0\u548e\uff0c\u56fa\u6709\u4e4b\u5730\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u56db\uff1a\u79f0\u5fc3\u7684\u5360\u95ee\uff0c\u6ca1\u6709\u707e\u96be\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5177\u6709\u8d1e\u6b63\u7684\u54c1\u5fb7\uff0c\u6ca1\u6709\u707e\u96be\uff0c\u7406\u5e94\u5982\u6b64\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u53ef\uff0c\u53ef\u5fc3\uff0c\u79f0\u5fc3\u3002\u53ef\u8d1e\uff0c\u79f0\u5fc3\u7684\u8d1e\u535c\u3002\u300a\u8c61\u8f9e\u300b\u91ca\u201c\u8d1e\u201d\u4e3a\u8d1e\u6b63\uff0c\u4e0e\u7ecf\u610f\u6709\u522b\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e94\uff1a\u65e0\u5984\u4e4b\u75be\uff0c\u52ff\u836f\u6709\u559c\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u65e0\u5984\u4e4b\u836f\uff0c\u4e0d\u53ef\u8bd5\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e94\uff1a\u60a3\u610f\u5916\u4e4b\u75c5\uff0c\u4e0d\u8981\u5fd9\u4e71\u670d\u836f\uff0c\u81ea\u53ef\u75ca\u6108\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u51fa\u4eba\u610f\u5916\u7684\u836f\u7269\uff0c\u4e0d\u53ef\u968f\u4fbf\u670d\u7528\u3002\n\u3010\u539f\u6587\u3011\n\u4e0a\u4e5d\uff1a\u65e0\u5984\u884c!\u6709\u771a\uff0c\u65e0\u6538\u5229\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u65e0\u5984\u4e4b\u884c\uff0c\u7a77\u4e4b\u707e\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u4e5d\uff1a\u4e0d\u8981\u80e1\u4f5c\u5984\u884c\uff01\u5c06\u6709\u707e\u6b83\uff0c\u6ca1\u6709\u597d\u5904\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u8c2c\u5984\u7684\u884c\u4e3a\uff0c\u662f\u7edd\u671b\u65e0\u804a\u7684\u8868\u73b0\u3002\n    "))
s.push(new K.R(p[6],p[0],"\u5c71\u5929\u5927\u755c","\u3010\u539f\u6587\u3011 \u5927\u755c\u2460\u3002\u5229\u8d1e\u3002\u4e0d\u5bb6\u98df\u2461\uff0c\u5409\u3002\u5229\u6d89\u5927\u5ddd\u3002\n\u3010\u8bd1\u6587\u3011 \u5927\u755c\u5366\uff1a\u5409\u5229\u7684\u8d1e\u5146\u3002\u4e0d\u98df\u4e8e\u5bb6\uff0c\u98df\u4e8e\u671d\u5ef7\uff0c\u5409\u5229\u3002\u7b6e\u9047\u6b64\u723b\uff0c\u6709\u5229\u4e8e\u6d89\u6c34\u6e21\u6cb3\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u5927\u755c\uff0c\u5366\u540d\u3002\u672c\u5366\u662f\u5f02\u5366\u76f8\u53e0(\u4e7e\u4e0b\u826e\u4e0a)\u3002\u5185\u5366\u4e3a\u4e7e\uff0c\u4e7e\u4e3a\u5929\uff0c\u5916\u5366\u4e3a\u826e\uff0c\u826e\u4e3a\u5c71\u3002\u592a\u9633\u5149\u7167\u8000\u5c71\u4e2d\uff0c\u50cf\u56fd\u5bb6\u517b\u8d24\uff0c\u5149\u8000\u671d\u5ef7\uff0c\u8d24\u4eba\u517b\u5fb7\uff0c\u6ecb\u6da6\u672c\u8eab\u3002\u6240\u4ee5\u5366\u540d\u66f0\u5927\u755c\u3002\u755c\uff0c\u300a\u91ca\u6587\u300b\uff1a\u201c\u755c\uff0c\u79ef\u4e5f\uff0c\u805a\u4e5f\u3002\u201d\u5927\u755c\uff0c\u72b9\u8a00\u79ef\u84c4\u8005\u5927\u3002\u2461\u4e0d\u51a2\u98df\uff0c\u72b9\u8a00\u4e0d\u98df\u4e8e\u5bb6\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u5927\u755c\uff0c\u521a\u5065\u7b03\u5b9e\u2460\uff0c\u8f89\u5149\u65e5\u65b0\u3002\u5176\u5fb7\u521a\u4e0a\u800c\u5c1a\u8d24\uff0c\u80fd\u6b62\u5065\u2461\uff0c\u5927\u6b63\u4e5f\u3002\u201c\u4e0d\u5bb6\u98df\uff0c\u5409\u201d\uff0c\u517b\u8d24\u4e5f\u3002\u201c\u5229\u6d89\u5927\u5ddd\u201d\uff0c\u5e94\u4e4e\u5929\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u5927\u755c\uff0c\u5185\u5366\u4e3a\u4e7e\u4e3a\u5929\uff0c\u6027\u521a\u5065\uff1b\u5916\u5366\u4e3a\u826e\u4e3a\u5c71\uff0c\u6027\u4e3a\u539a\u5b9e\u3002\u5929\u5149\u5c71\u6c14\u76f8\u6620\u751f\u8f89\uff0c\u5149\u666f\u5e38\u65b0\u3002\u5b83\u7684\u542b\u8574\u662f\u521a\u9633\u8212\u5c55\uff0c\u8d24\u4eba\u5f97\u4f4d\uff0c\u884c\u4e3a\u521a\u5065\uff0c\u9002\u800c\u53ef\u6b62\uff0c\u6b63\u6240\u8c13\u54c1\u5fb7\u4f1f\u5927\uff0c\u884c\u4e3a\u8d1e\u6b63\u3002\u201c\u4e0d\u5728\u5bb6\u91cc\u5403\u996d\uff0c\u5409\u5229\u201d\uff0c\u662f\u8bf4\u56fd\u5bb6\u4ee5\u539a\u7984\u517b\u8d24\u3002\u201c\u6709\u5229\u4e8e\u6d89\u6c34\u6e21\u6cb3\u201d\uff0c\u662f\u8bf4\u80fd\u591f\u9075\u5faa\u81ea\u7136\u89c4\u5f8b\u6d89\u6e21\u5927\u6cb3\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u521a\u5065\uff0c\u4e0b\u5366\u4e3a\u4e7e\uff0c\u4e7e\u6027\u521a\u5065\u3002\u7b03\u5b9e\uff0c\u4e0a\u5366\u4e3a\u826e\u4e3a\u5c71\uff0c\u5c71\u6027\u539a\u5b9e\u3002\u7b03\uff0c\u539a\u3002\u2461\u80fd\u6b62\u5065\uff0c\u300a\u96c6\u89e3\u300b\u672c\u4f5c\u80fd\u5065\u6b62\u3002\u9ad8\u4ea8\u8bf4\uff1a\u201c\u5f53\u4f5c\u2018\u5065\u80fd\u6b62\u2019\uff0c\u8f6c\u5199\u4e4b\u8bef\u3002\u80fd\u8bfb\u4e3a\u800c\u3002\u201d\n\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u5929\u5728\u5c71\u4e2d\uff0c\u5927\u755c\u3002\u541b\u5b50\u4ee5\u591a\u8bc6\u524d\u8a00\u5f80\u884c\uff0c\u5fc5\u755c\u5176\u5fb7\u3002 \n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5185\u5366\u4e3a\u4e7e\u4e3a\u5929\uff0c\u5916\u5366\u4e3a\u826e\u4e3a\u5c71\uff0c\u592a\u9633\u7167\u8000\u4e8e\u5c71\u4e2d\uff0c\u4e07\u7269\u6444\u53d6\u9633\u5149\u96e8\u9732\uff0c\u5404\u9042\u5176\u751f\uff0c\u8fd9\u662f\u5927\u755c\u7684\u5366\u8c61\u3002\u541b\u5b50\u89c2\u6b64\u5366\u8c61\uff0c\u4ece\u800c\u5e7f\u6cdb\u5730\u4e86\u89e3\u53e4\u4eba\u7684\u5609\u8a00\u5584\u884c\uff0c\u6765\u57f9\u517b\u81ea\u5df1\u7684\u5fb7\u884c\u3002\n\u3010\u539f\u6587\u3011\n\u521d\u4e5d\uff1a\u6709\u5389\uff0c\u5229\u5df3\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u6709\u5389\uff0c\u5229\u5df3\uff0c\u4e0d\u72af\u707e\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u4e5d\uff1a\u5c06\u6709\u5371\u9669\uff0c\u796d\u7940\u9b3c\u795e\u5219\u80fd\u5316\u51f6\u4e3a\u5409\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5c06\u6709\u5371\u9669\uff0c\u505c\u6b62\u6240\u4e3a\u5219\u80fd\u5316\u51f6\u4e3a\u5409\uff0c\u56e0\u4e3a\u8fd9\u6837\u5c31\u4e0d\u4f1a\u72af\u707e\u89e6\u96be\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u5389\uff0c\u5371\u96be\uff0c\u5371\u9669\u3002\u5df3\uff0c\u95fb\u4e00\u591a\u8bf4\uff1a\u201c\u5df3\uff0c\u5f53\u8bfb\u4e3a\u7940\u3002\u201d\u300a\u8c61\u8f9e\u300b\u89e3\u201c\u5df3\u201d\u4e3a\u6b62\uff0c\u4e0e\u7ecf\u610f\u4e0d\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e8c\uff1a\u8206\u8bf4\u8f39\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u8206\u8bf4\u8f39\uff0c\u4e2d\u65e0\u5c24\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e8c\uff1a\u8f66\u8f90\u8131\u843d\uff0c\u8f66\u8f6e\u574f\u4e86\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u8f66\u8f90\u8131\u843d\u8f66\u8f6e\u574f\u4e86\uff0c\u4e5d\u4e8c\u4e4b\u723b\u5c45\u4e0b\u5366\u4e2d\u4f4d\uff0c\u8fd9\u79cd\u723b\u8c61\u8868\u660e\u6bd5\u7adf\u6ca1\u6709\u5fe7\u60a3\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8206\uff0c\u8f66\u3002\u8bf4\uff0c\u8bfb\u4e3a\u8131\u3002\u8f39\uff0c\u501f\u4e3a\u8f90\uff0c\u8f66\u8f6e\u4e0a\u8fde\u63a5\u8f66\u8f86\u548c\u8f66\u6bc2\u7684\u76f4\u6761\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e09\uff1a\u826f\u9a6c\u9010\u2460\u3002\u5229\u8270\u8d1e\u3002\u65e5\u95f2\u8206\u536b\u2461\u3002\u5229\u6709\u6538\u5f80\u2462\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5229\u6709\u6538\u5f80\uff0c\u4e0a\u5408\u5fd7\u4e5f\u2463\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e09\uff1a\u826f\u9a6c\u4ea4\u914d\u3002\u5360\u95ee\u8270\u96be\u4e4b\u4e8b\u5409\u5229\u3002\u6bcf\u5929\u7ec3\u4e60\u9632\u536b\u6027\u8f66\u6218\u3002\u6709\u6240\u5f80\u5219\u6709\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u6709\u6240\u5f80\u5219\u6709\u5229\uff0c\u6240\u5f80\u5fc5\u5f97\uff0c\u5c1a\u53ef\u7b26\u5408\u5fc3\u610f\u3002\n\u3010\u6ce8\u91ca\u3011 \n\u2460\u9010\uff0c\u6c99\u5c11\u6d77\u5148\u751f\u8bf4\uff1a\u201c\u8bad\u4ea4\u914d\u3002\u201d\u300a\u96c6\u97f5\u300b\uff1a\u201c\u9010\uff0c\u725d\u7261\u5408\u4e5f\u3002\u201d\u2461\u65e5\uff0c\u95fb\u4e00\u591a\u8bf4\uff1a\u201c\u300a\u91ca\u6587\u300b\u5f15\u90d1\u672c\u66f0\u4f5c\u65e5\u3002\u6ce8\u66f0\uff1a\u2018\u65e5\u4e60\u8f66\u5f92\u3002\u2019\u4e8e\u4e49\u4e3a\u957f\u3002\u201d\u95f2\uff0c\u901a\u5a34\uff0c\u719f\u4e60\uff0c\u719f\u7ec3\u3002\u8206\u536b\uff0c\u8f66\u6218\u4e2d\u7684\u9632\u536b\u4f5c\u6218\u3002\u2462\u6b64\u723b\u5171\u5360\u56db\u4e8b\uff1a\u535c\u9a6c\u7fa4\u4ea4\u914d\uff0c\u535c\u8270\u96be\u4e4b\u4e8b\uff0c\u535c\u7ec3\u4e60\u8f66\u6218\uff0c\u535c\u65c5\u884c\u3002\u300a\u6613\u5366\u300b\u5c06\u6b64\u914d\u5408\u5728\u4e00\u8d77\uff0c\u7cfb\u4e8e\u672c\u5366\u4e5d\u4e09\u8fd9\u4e00\u5409\u5229\u7684\u723b\u8c61\u4e4b\u4e00\uff0c\u4ee5\u793a\u56db\u4e8b\u5747\u5229\u3002\u6587\u5b57\u95f4\u4e0d\u53ef\u5f3a\u4e3a\u8d2f\u901a\u3002\u2463\u4e0a\uff0c\u8bfb\u4e3a\u5c1a\u3002\u5fd7\uff0c\u5fc3\u610f\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u56db\uff1a\u7ae5\u725b\u4e4b\u727f\u2460\uff0c\u5143\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u516d\u56db\u5143\u5409\uff0c\u6709\u559c\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u56db\uff1a\u5c06\u6728\u68d2\u6a2a\u7f1a\u5728\u597d\u6597\u516c\u725b\u7684\u7284\u89d2\u4e0a\u3002\u7b6e\u9047\u6b64\u723b\uff0c\u5927\u5409\u5927\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u516d\u56db\u723b\u8f9e\u8bb2\u7684\u5927\u5409\u5927\u5229\uff0c\u662f\u6307\u5c06\u6709\u559c\u5e86\u4e4b\u4e8b\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u674e\u955c\u6c60\u8bf4\uff1a\u201c\u7ae5\u725b\uff0c\u516c\u725b\u3002\u7ae5\u501f\u4e3a*\u3002\u201d\u727f\uff0c\u300a\u96c6\u89e3\u300b\u4f5c\u544a\u3002\u5f15\u865e\u7ffb\u66f0\uff1a\u201c\u7ef3\u7f1a\u5c0f\u6728\uff0c\u6a2a\u8457\u725b\u89d2\u3002\u201d\u300a\u8bf4\u6587\u300b\u544a\u90e8\u5f15\u300a\u6613\u300b\u4f5c\u7ae5\u4e4b\u544a\u3002\u725b\u89e6\u4eba\uff0c\u89d2\u8457\u6a2a\u6728\uff0c\u6240\u4ee5\u544a\u4eba\u4e5f\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e94\uff1a\u8c6e\u8c55\u4e4b\u7259\u2460\u3002\u5409\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u516d\u4e94\u4e4b\u5409\uff0c\u6709\u5e86\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e94\uff1a\u5c06\u597d\u5954\u7a81\u7684\u5927\u732a\u5708\u8d77\u6765\uff0c\u5409\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u516d\u4e94\u723b\u8f9e\u8bb2\u7684\u5409\u5229\uff0c\u662f\u6307\u6709\u82e6\u5e86\u4e4f\u4e8b\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8c6e(f\xe9n)\uff0c\u4e49\u4e3a\u5954\u3002\u8c6e\u8c55\uff0c\u5954\u7a81\u7684\u5927\u732a\u3002\u7259\uff0c\u300a\u91ca\u6587\u300b\uff1a\u201c\u90d1\u8bfb\u4e3a\u4e92\u3002\u201d\u6c99\u5c11\u6d77\u5148\u751f\u8bf4\uff1a\u201c\u4e92\u52a0\u6728\u4e3a\u6791\uff0c\u8bad\u732a\u680f\uff0c\u5373\u4eca\u8bed\u6240\u8c13\u732a\u5708\u3002\u201d\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u4e5d\uff1a\u4f55\u5929\u4e4b\u8862\u2460\u3002\u4ea8\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4f55\u5929\u4e4b\u8862\uff0c\u9053\u5927\u884c\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u4e5d\uff1a\u5f97\u5230\u4e0a\u5929\u7684\u798f\u4f51\uff0c\u5927\u5409\u5927\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5f97\u5230\u4e0a\u5929\u7684\u798f\u4f51\uff0c\u884c\u4e8b\u7545\u901a\u65e0\u963b\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u4f55\uff0c\u5f53\u8bfb\u4e3a\u8377\uff0c\u627f\u53d7\u3002\u8862\uff0c\u6c99\u5c11\u6d77\u5148\u751f\u8bf4\uff1a\u201c\u8fd9\u91cc\u58f0\u5047\u4e3a\u4f11\uff0c\u8bad\u798f\u7984\u3002\u89c1\u300a\u5de6\u4f20?\u8944\u516c\u4e8c\u5341\u516b\u5e74\u300b\uff1a\u2018\u4ee5\u793c\u627f\u5929\u4e4b\u4f11\u3002\u2019\u6309\u8862\uff0c\u4ece*\u58f0\u3002*\uff0c\u8bfb\u82e5\u62d8(\u300a\u8bf4\u6587\u300b)\u3002\u4f11\uff0c\u8bfb\u82e5\u7166(\u89c1\u300a\u5468\u793c\u8003\u5de5\u8bb0?\u5f13\u4eba\u300b\u2018\u4f11\u4e88\u6c14\u2019\u90d1\u6ce8)\u3002\u62d8\u3001\n\u7166\u5747\u4ece\u53e5\u58f0\u3002\u6545\u8862\u3001\u4f11\u58f0\u8fd1\u4e49\u901a\u3002\u201d\n    "))
s.push(new K.R(p[6],p[3],"\u5c71\u96f7\u9890","\u3010\u539f\u6587\u3011 \u9890\u2460\uff1a\u8d1e\u5409\u3002\u89c2\u9890\uff0c\u81ea\u6c42\u53e3\u5b9e\u2461\u3002\n\u3010\u8bd1\u6587\u3011 \u9890\u5366\uff1a\u5360\u535c\u5f97\u5409\u5146\u3002\u7814\u7a76\u9890\u517b\u4e4b\u9053\uff0c\u5728\u4e8e\u81ea\u98df\u5176\u529b\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u9890\uff0c\u5366\u540d\u3002\u672c\u5366\u4e3a\u5f02\u5366\u76f8\u53e0(\u9707\u4e0b\u826e\u4e0a)\u3002\u4e0a\u5366\u4e3a\u826e\uff0c\u826e\u4e3a\u5c71\uff0c\u4e0b\u5366\u4e3a\u9707\uff0c\u9707\u4e3a\u96f7\uff0c\u96f7\u51fa\u5c71\u4e2d\uff0c\u6b63\u662f\u6625\u6696\u4e4b\u9645\uff0c\u5929\u5730\u517b\u80b2\u4e07\u7269\u4e4b\u65f6\u3002\u5728\u300a\u6613\u5366\u300b\u770b\u6765\u6b63\u55bb\u5723\u4eba\u4f9d\u65f6\u517b\u8d24\u80b2\u6c11\uff0c\u8d24\u4eba\u4fee\u5fb7\u517b\u8eab\u3002\u6240\u4ee5\u5366\u540d\u66f0\u9890\u3002\u9890\uff0c\u300a\u5c14\u96c5?\u91ca\u8bc2\u300b\uff1a\u201c\u9890\uff0c\u517b\u4e5f\u3002\u201d\u2461\u53e3\u5b9e\uff0c\u53e3\u7cae\uff0c\u81ea\u6c42\u53e3\u5b9e\uff0c\u72b9\u8a00\u81ea\u8c0b\u53e3\u7cae\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u9890\uff0c\u201c\u8d1e\u5409\u201d\uff0c\u517b\u6b63\u5219\u5409\u4e5f\u3002\u201c\u89c2\u9890\u201d\uff0c\u89c2\u5176\u6240\u517b\u4e5f\u3002\u201c\u81ea\u6c42\u53e3\u5b9e\u201d\uff0c\u89c2\u5176\u81ea\u517b\u4e5f\u3002\u5929\u5730\u517b\u4e07\u7269\u3002\u5723\u4eba\u517b\u8d24\u4ee5\u53ca\u4e07\u6c11\u3002\u9890\u4e4b\u65f6\u5927\u77e3\u54c9\u3002 \n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u9890\u5366\u5366\u8f9e\u8bb2\uff0c\u201c\u8d1e\u6b63\u5409\u5229\u201d\uff0c\u610f\u601d\u662f\u4f9d\u5faa\u6b63\u9053\u9890\u517b\u4eba\u6211\u5219\u5409\u5229\u3002\u201c\u89c2\u5ba1\u9890\u517b\u201d\uff0c\u5c31\u662f\u89c2\u5bdf\u6240\u9890\u517b\u7684\u5bf9\u8c61\u3002\u201c\u81ea\u98df\u5176\u529b\u201d\uff0c\u5c31\u662f\u89c2\u5bdf\u4ed6\u600e\u6837\u517b\u6d3b\u81ea\u5df1\u3002\u5929\u5730\u517b\u80b2\u4e07\u7269\uff0c\u5723\u4eba\u9890\u517b\u8d24\u4eba\uff0c\u517b\u80b2\u4e07\u6c11\u3002\u9890\u517b\u7269\u6211\u4e0d\u5931\u5176\u65f6\uff0c\u8fd9\u662f\u591a\u4e48\u4f1f\u5927\u3002\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u5c71\u4e0b\u6709\u96f7\u2460\uff0c\u9890\u3002\u541b\u5b50\u4ee5\u614e\u8a00\u8bed\uff0c\u8282\u996e\u98df\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u672c\u5366\u4e0a\u5366\u4e3a\u826e\u4e3a\u5c71\uff0c\u4e0b\u5366\u4e3a\u9707\u4e3a\u96f7\uff0c\u96f7\u51fa\u5c71\u4e2d\uff0c\u4e07\u7269\u840c\u53d1\uff0c\u8fd9\u662f\u9890\u5366\u7684\u5366\u8c61\u3002\u541b\u5b50\u89c2\u6b64\u5366\u8c61\uff0c\u601d\u751f\u517b\u4e4b\u4e0d\u6613\uff0c\u4ece\u800c\u8c28\u614e\u8a00\u8bed\uff0c\u907f\u514d\u707e\u7978\u3002\u8282\u5236\u996e\u98df\uff0c\u4fee\u8eab\u517b\u6027\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u5c71\u4e0b\u6709\u96f7\uff0c\u53e4\u4eba\u8ba4\u4e3a\u5929\u6696\u4e4b\u65f6\uff0c\u96f7\u751f\u4e8e\u5730\uff0c\u9707\u52a8\u4e07\u7269\uff0c\u840c\u53d1\u751f\u957f\u3002 \n\n\u3010\u539f\u6587\u3011\n\u521d\u4e5d\uff1a\u820d\u5c14\u7075\u9f9f\uff0c\u89c2\u6211\u6735\u9890\u2460\uff0c\u51f6\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u89c2\u6211\u6735\u9890\uff0c\u4ea6\u4e0d\u8db3\u8d35\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u4e5d\uff1a\u81ea\u5df1\u50a8\u85cf\u7740\u5927\u91cf\u7684\u8d22\u5b9d\uff0c\u8fd8\u8981\u7fa1\u5ac9\u4eba\u5bb6\u7684\u8d22\u7269\uff0c\u5fc5\u906d\u51f6\u9669\u4e4b\u4e8b\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u7fa1\u5ac9\u4eba\u5bb6\u7684\u8d22\u7269\uff0c\u8fd9\u4e0d\u662f\u9ad8\u5c1a\u7684\u884c\u4e3a\u3002\n\u3010\u5f80\u91ca\u3011\n\u2460\u820d\uff0c\u653e\u7f6e\u3002\u7075\u9f9f\uff0c\u674e\u955c\u6c60\u8bf4\uff1a\u201c\u4ee3\u6307\u8d22\u5b9d\uff0c\u8d22\u5bcc\u3002\u8fd9\u539f\u662f\u5360\u535c\u7528\u7684\uff0c\u5341\u5206\u8d35\u91cd\u3002\u201d\u6735\u9890\uff0c\u674e\u955c\u6c60\u8bf4\uff1a\u201c\u9890\u9894\u4e30\u6ee1\uff0c\u5706\u9f13\u9f13\u7684\uff0c\u50cf\u82b1\u6735\u4e00\u6837\u3002\u8fd9\u662f\u4e30\u8863\u8db3\u98df\u7684\u8c61\u5f81\u3002\u201d\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e8c\uff1a\u98a0\u9890\uff0c\u62c2\u7ecf\u4e8e\u4e18\u2460\u3002\u9890\u5f81\u2461\uff0c\u51f6\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u516d\u4e8c\u5f81\u51f6\uff0c\u884c\u5931\u7c7b\u4e5f\u3002 \n\u3010\u8bd1\u6587\u3011\n\u516d\u4e8c\uff1a\u4e3a\u4e86\u992c\u53e3\uff0c\u5c31\u5f97\u5728\u5c71\u5761\u4e0a\u5f00\u8352\u79cd\u5730\u3002\u4e3a\u4e86\u751f\u8ba1\u800c\u53bb\u62a2\u52ab\u522b\u4eba\uff0c\u8fd9\u662f\u51f6\u9669\u4e4b\u4e8b\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u516d\u4e8c\u723b\u8f9e\u8bf4\u62a2\u52ab\u5219\u51f6\uff0c\u56e0\u4e3a\u8fd9\u79cd\u884c\u5f84\u8fdd\u53cd\u9053\u4e49\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u98a0\uff0c\u9ad8\u4ea8\u8bf4\uff1a\u201c\u501f\u4e3a\u586b\uff0c\u585e\u4e5f\u3002\u586b\u9890\uff0c\u7eb3\u98df\u7269\u5b50\u816e\u4e2d\u3002\u201d\u62c2\uff0c\u674e\u955c\u6c60\u8bf4\uff1a\u201c\u501f\u4e3a\u521c\uff0c\u58f0\u901a\u3002\u521c\uff0c\u51fb\u4e5f(\u300a\u8bf4\u6587\u300b)\uff0c\u65ab\u4e5f(\u300a\u5e7f\u96c5?\u91ca\u8a00\u300b)\u3002\u201d\u7ecf\uff0c\u300a\u5e7f\u96c5?\u91ca\u8a00\u300b\uff1a\u201c\u5f84\u4e5f\u201d\uff0c\u6307\u9621\u964c\u3002\u62c2\u7ecf\uff0c\u8fd9\u91cc\u6307\u57a6\u8352\u5f00\u7530\u3002\u2461\u9890\uff0c\u9890\u517b\u3002\u5f81\uff0c\u5f81\u4f10\uff0c\u653b\u51fb\u3002\u9890\u5f81\uff0c\u72b9\u8a00\u4e3a\u4e86\u751f\u8ba1\u800c\u53bb\u62a2\u52ab\u522b\u4eba\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e09\uff1a\u62c2\u9890\u2460\uff0c\u8d1e\u51f6\u3002\u5341\u5e74\u52ff\u7528\uff0c\u3002\u65e0\u6538\u5f80\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5341\u5e74\u52ff\u7528\uff0c\u9053\u5927\u6096\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e09\uff1a\u8fdd\u80cc\u517b\u751f\u6b63\u9053\uff0c\u9760\u6b6a\u95e8\u90aa\u9053\u8fc7\u6d3b\uff0c\u5360\u95ee\u5f97\u51f6\u5146\u3002\u5341\u5e74\u90fd\u5f97\u5012\u9709\uff0c\u6c38\u65e0\u597d\u5904\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5341\u5e74\u90fd\u5f97\u5012\u9709\uff0c\u56e0\u4e3a\u8fd9\u79cd\u884c\u4e3a\u5927\u6709\u6096\u4e8e\u9053\u4e49\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u62c2\uff0c\u8fdd\u80cc\u3002\u9890\uff0c\u8fd9\u91cc\u6307\u9890\u517b\u4e4b\u9053\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u56db\uff1a\u98a0\u9890\u2460\uff0c\u5409\u3002\u864e\u89c6\u7708\u7708\uff0c\u5176\u6b32\u9010\u9010\u2461\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u98a0\u9890\u4e4b\u5409\uff0c\u4e0a\u65bd\u5149\u4e5f\u2462\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u56db\uff1a\u6240\u6c42\u4e0d\u8fc7\u992c\u53e3\uff0c\u5bb3\u4eba\u4e4b\u5fc3\u4e0d\u53ef\u5b58\uff0c\u5409\u5229\u3002\u864e\u89c6\u7708\u7708\uff0c\u9632\u4eba\u4e4b\u5fc3\u4e0d\u53ef\u65e0\u3002\u8fd9\u6837\u5c31\u53ef\u4ee5\u5b89\u4eab\u5929\u5e74\uff0c\u60a0\u7136\u81ea\u5f97\uff0c\u65e0\u707e\u7978\u3002\n\u300a\u8c61\u8f9e\u300b\uff1a\u6240\u6c42\u4e0d\u8fc7\u992c\u53e3\uff0c\u4e4b\u6240\u4ee5\u5409\u5229\uff0c\u56e0\u4e3a\u541b\u4e0a\u65bd\u820d\u751a\u5e7f\uff0c\u8db3\u4ee5\u517b\u6c11\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u98a0\uff0c\u58f0\u5047\u4e3a\u586b\u3002\u98a0\u9890\uff0c\u72b9\u8a00\u992c\u53e3\u3002\u8be6\u524d\u6ce8\u3002\u2461\u300a\u91ca\u6587\u300b\uff1a\u201c\u9010\u9010\uff0c\u8340\u4f5c\u60a0\u60a0\u201d\u3002\u5b89\u7136\u81ea\u5f97\u4e4b\u8c8c\u3002\u2462\u5149\uff0c\u501f\u4e3a\u5e7f\u3002\u4e0a\uff0c\u541b\u4e0a\u3002\u65bd\uff0c\u65bd\u820d\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u4e94\uff1a\u62c2\u7ecf\u2460\uff0c\u5c45\uff0c\u8d1e\u5409\u3002\u4e0d\u53ef\u6d89\u5927\u5ddd\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u5c45\u8d1e\u4e4b\u5409\uff0c\u987a\u4ee5\u4ece\u4e0a\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u4e94\uff1a\u5f00\u8352\u79cd\u5730\uff0c\u5e73\u5c45\u5ea6\u65e5\uff0c\u5360\u95ee\u5f97\u5409\u5146\u3002\u7b6e\u9047\u6b64\u723b\uff0c\u4e0d\u53ef\u6d89\u6c34\u6e21\u6cb3\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5e73\u5c45\u5b88\u6b63\uff0c\u4e4b\u6240\u4ee5\u5409\u5229\uff0c\u56e0\u4e3a\u5176\u4eba\u5b89\u4efd\u5faa\u9053\uff0c\u670d\u4ece\u541b\u4e0a\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u62c2\uff0c\u501f\u4e3a\u521c\u3002\u7ecf\uff0c\u5373\u5f84\uff0c\u9621\u964c\u3002\u62c2\u7ecf\uff0c\u6307\u5f00\u8352\u79cd\u5730\u3002\u8be6\u524d\u6ce8\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u4e5d\uff1a\u7531\u9890\u2460\uff0c\u5389\uff0c\u5409\u3002\u5229\u6d89\u5927\u5ddd\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u7531\u9890\uff0c\u5389\uff0c\u5409\uff0c\u5927\u6709\u5e86\u4e5f\u3002\n\u3010\u6cfd\u6587\u3011\n\u4e0a\u4e5d\uff1a\u9075\u5faa\u751f\u6d3b\u6b63\u9053\uff0c\u5148\u8270\u96be\u800c\u7ec8\u5409\u5229\u3002\u7b6e\u9047\u6b64\u723b\uff0c\u6709\u5229\u4e8e\u6d89\u6c34\u6e21\u6cb3\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u9075\u5faa\u751f\u6d3b\u6b63\u9053\uff0c\u5148\u8270\u96be\u800c\u7ec8\u5409\u5229\uff0c\u56e0\u4e3a\u5584\u826f\u4e4b\u4eba\u7ec8\u5f97\u5584\u62a5\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u7531\uff0c\u9075\u5faa\u3002\u9890\uff0c\u9890\u517b\u4e4b\u9053\u3002\n    "))
s.push(new K.R(p[1],p[4],"\u6cfd\u98ce\u5927\u8fc7","\u3010\u539f\u6587\u3011 \u5927\u8fc7\u2460\uff1a\u680b\u6861\u2461\u3002\u5229\u6709\u6538\u5f80\uff0c\u4ea8\u2462\u3002\n\u3010\u8bd1\u6587\u3011 \u5927\u8fc7\u5366\uff1a\u5c4b\u7cb1\u538b\u5f97\u5f2f\u66f2\u4e86\u3002\u6709\u6240\u5f80\u5219\u6709\u5229\uff0c\u901a\u6cf0\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u5927\u8fc7\uff0c\u5366\u540d\u3002\u672c\u5366\u4e3a\u5f02\u5366\u76f8\u53e0(\u5dfd\u4e0b\u5151\u4e0a)\u3002\u4e0a\u5366\u4e3a\u5151\uff0c\u5151\u4e3a\u6cfd\uff1b\u4e0b\u5366\u4e3a\u5dfd\uff0c\u5dfd\u4e3a\u98ce\u4e3a\u6728\u3002\u4e0a\u5151\u4e0b\u5dfd\uff0c\u6709\u6cfd\u6c34\u6df9\u6ca1\u6728\u821f\u4e4b\u8c61\u3002\u5151\u3001\u5dfd\u76f8\u8fed\uff0c\u4e2d\u95f4\u56db\u723b\u4e3a\u9633\u723b\uff0c\u521d\u3001\u4e0a\u4e3a\u9634\u723b\uff0c\u9633\u76db\u800c\u9634\u67d4\uff0c\u4e2d\u58ee\u800c\u7aef\u5f31\uff0c\u4e5f\u5146\u793a\u7740\u6298\u6bc1\u4e4b\u8c61\u3002\u55bb\u4eba\u541b\u4eba\u81e3\uff0c\u884c\u4e8b\u5927\u9519\uff0c\u5219\u5c06\u6709\u680b\u6298\u7cb1\u6467\u4e4b\u9669\u3002\u6240\u4ee5\u5366\u540d\u66f0\u5927\u8fc7\u3002\u8fc7\uff0c\u8fc7\u5931\u3002\u2461\u680b\uff0c\u5c4b\u6b63\u4e2d\u6700\u9ad8\u7684\u6a2a\u6881\u3002\u6861\uff0c\u6c99\u5c11\u6d77\u5148\u751f\u8bf4\uff1a\u201c\u539f\u672c\u4f5c\u6320\u3002\u300a\u6821\u52d8\u8bb0\u300b\u66f0\uff1a\u2018\u6320\uff0c\u5404\u672c\u4f5c\u6861\u3002\u2019\u201d\u4eca\u4ece\u4e4b\u3002\u6861\uff0c\u5f2f\u66f2\u3002\u2462\u201c\u5229\u6709\u6538\u5f80\uff0c\u4ea8\u3002\u201d\u6b64\u5c5e\u53e6\u5916\u4e00\u6b21\u8d1e\u535c\u7684\u8bb0\u5f55\uff0c\u6587\u4e49\u4e0a\u4e0d\u8fc7\u53ef\u5f3a\u4e3a\u8d2f\u901a\u3002\u300a\u6613\u5366\u300b\u4f5c\u8005\u5c06\u8fd9\u51f6\u5409\u7edd\u7136\u76f8\u53cd\u7684\u5360\u535c\u4e4b\u8f9e\u540c\u7cfb\u4e8e\u4e00\u5366\uff0c\u610f\u5728\u53cd\u6620\u5927\u8fc7\u7684\u5366\u3001\u723b\u4e4b\u8c61\u9884\u793a\u7740\u591a\u79cd\u610f\u4e49\u3002\u300a\u5f56\u8f9e\u300b\u6b63\u7f18\u6b64\u610f\u8fdb\u884c\u89e3\u91ca\u3002\u6d0b\u300a\u5f56\u8f9e\u300b\u8bd1\u6587\u3002 \n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u5927\u8fc7\uff0c\u5927\u8005\u8fc7\u4e5f\u3002\u201c\u680b\u6861\u201d\uff0c\u672c\u672b\u5f31\u4e5f\u3002\u521a\u8fc7\u800c\u4e2d\u2460\uff0c\u5dfd\u800c\u8bf4\u2461\u884c\uff0c\u201c\u5229\u6709\u6538\u5f80\u201d\uff0c\u4e43\u201c\u4ea8\u201d\u3002\u5927\u8fc7\u4e4b\u65f6\u5927\u77e3\u54c9\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u5927\u8fc7\uff0c\u610f\u601d\u662f\u5927\u800c\u8fc7\u5f53\u3002_\u201c\u680b\u6881\u5f2f\u66f2\u201d\uff0c\u5c31\u662f\u56e0\u4e3a\u6a2a\u6881\u4e2d\u90e8\u592a\u7c97\uff0c\u4e24\u5934\u592a\u7ec6\uff0c\u4e0d\u582a\u8d1f\u8377\u3002\u672c\u5366\u9633\u723b\u591a\uff0c\u9634\u723b\u5c11\uff0c\u9633\u521a\u8fc7\u76db\uff1b\u4f46\u662f\u4e5d\u4e8c\u3001\u4e5d\u4e94\u4e4b\u723b\u5206\u5c45\u4e0b\u5366\u3001\u4e0a\u5366\u4e4b\u4e2d\u4f4d\uff0c\u50cf\u4eba\u5f97\u8d1e\u6b63\u4e4b\u9053\uff0c\u6709\u8c26\u900a\u800c\u548c\u60a6\u7684\u54c1\u5fb7\u3002\u79c9\u6b64\u884c\u4e8b\uff0c\u201c\u6709\u6240\u5f80\u5219\u5fc5\u6709\u5229\u201d\uff0c\u6240\u4ee5\u53c8\u8bf4\u201c\u901a\u6cf0\u201d\u3002\u5927\u8fc7\u4e4b\u5366\uff0c\u5e76\u5bb9\u51f6\u5409\u4e4b\u8c61\uff0c\u56e0\u6b64\u5176\u610f\u4e49\u662f\u91cd\u5927\u7684\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u521a\u8fc7\u800c\u4e2d\u3002\u672c\u5366\u4e8c\u3001\u4e09\u3001\u56db\u3001\u4e94\uff0c\u56db\u723b\u4e3a\u9633\uff0c\u521d\u3001\u4e5d\u4e3a\u9634\uff0c\u6240\u8c13\u9633\u521a\u8fc7\u76db\u3002\u201c\u4e2d\u201d\uff0c\u4ee5\u4e5d\u4e8c\uff0c\u4e5d\u4e94\u4e4b\u723b\u4f4d\u4e3a\u636e\u3002\u2461\u5dfd\u800c\u8bf4\uff0c\u672c\u5366\u4e0a\u5366\u4e3a\u5151\uff0c\u5151\u4e49\u4e3a\u60a6\uff0c\u4e0b\u5366\u4e3a\u5dfd\uff0c\u5dfd\u4e49\u4e3a\u8c26\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u6cfd\u706d\u6728\uff0c\u5927\u8fc7\u3002\u541b\u5b50\u4ee5\u72ec\u7acb\u4e0d\u60e7\uff0c\u9041\u4e16\u65e0\u95f7\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u672c\u5366\u4e0a\u5366\u4e3a\u5151\u4e3a\u6cfd\uff0c\u4e0b\u5366\u4e3a\u5dfd\u4e3a\u6728\uff0c\u4e0a\u5151\u4e0b\u5dfd\uff0c\u6cfd\u6c34\u6df9\u6ca1\u6728\u821f\uff0c\u8fd9\u662f\u5927\u8fc7\u7684\u5366\u8c61\u3002\u541b\u5b50\u89c2\u6b64\u5366\u8c61\uff0c\u4ee5\u821f\u91cd\u5219\u8986\u4e3a\u6212\uff0c\u9886\u609f\u5230\u906d\u9022\u7978\u53d8\uff0c\u5e94\u5b88\u8282\u4e0d\u5c48\uff0c\u7a33\u5c45\u4e0d\u4ed5\uff0c\u6e05\u9759\u6de1\u6cca\u3002 \n\n\u3010\u539f\u6587\u3011\n\u521d\u516d\uff1a\u85c9\u7528\u767d\u8305\uff0c\u65e0\u548e\u2460\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u85c9\u7528\u767d\u8305\uff0c\u67d4\u5728\u4e0b\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u516d\uff1a\u606d\u656c\u5730\u7528\u767d\u8305\u57ab\u7740\u796d\u54c1\uff0c\u53ef\u4ee5\u65e0\u707e\u7978\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u201c\u606d\u656c\u5730\u7528\u767d\u8305\u57ab\u7740\u796d\u54c1\u201d\uff0c\u67d4\u8f6f\u4e4b\u7269\u94fa\u57ab\u5728\u4e0b\u9762\uff0c\u6b63\u50cf\u521d\u516d\u9634\u723b\u5c45\u4e00\u5366\u4e4b\u4e0b\u4f4d\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u85c9\uff0c\u94fa\u57ab\u3002\u767d\u8305\uff0c\u8349\u540d\uff0c\u67d4\u8f6f\u6d01\u767d\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e8c\uff1a\u67af\u6768\u751f\u7a0a\u2460\uff0c\u8001\u592b\u5f97\u5176\u5973\u59bb\uff0c\u65e0\u4e0d\u5229\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u8001\u592b\u5c11\u59bb\uff0c\u8fc7\u4ee5\u76f8\u4e0e\u4e5f\u2461\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e8c\uff1a\u67af\u6768\u53d1\u82bd\uff0c\u8001\u5934\u5b50\u5a36\u5c11\u5973\u4e3a\u59bb\uff0c\u5e76\u65e0\u4e0d\u5409\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u592b\u8001\u59bb\u5c11\uff0c\u5e74\u9f84\u4e0d\u5f53\uff0c\u8fd9\u662f\u9519\u8bef\u7684\u5a5a\u914d\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u7a0a\uff0c\u501f\u4e3a\u8351\uff0c\u8349\u6728\u65b0\u751f\uff0c\u53d1\u82bd\u3002\u2461\u8fc7\uff0c\u9519\u8bef\u3002\u76f8\u4e0e\uff0c\u6307\u5a5a\u59fb\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e09\uff1a\u680b\u6861\uff0c\u51f6\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u680b\u6861\u4e4b\u51f6\uff0c\u4e0d\u53ef\u4ee5\u6709\u8f85\u4e5f\u2460\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e09\uff1a\u5c4b\u6881\u5f2f\u66f2\uff0c\u8fd9\u662f\u51f6\u9669\u4e4b\u8c61\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5c4b\u6881\u5f2f\u66f2\u4e4b\u6240\u4ee5\u51f6\u9669\uff0c\u56e0\u4e3a\u680b\u66f2\u5373\u5c4b\u503e\uff0c\u65e0\u6cd5\u652f\u6491\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8f85\uff0c\u52a9\u3002\u8fd9\u91cc\u6307\u652f\u6491\u3002\n\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u56db\uff1a\u680b\u9686\u2460\uff0c\u5409\u3002\u6709\u5b83\u2461\uff0c\u541d\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u680b\u9686\u4e4b\u5409\uff0c\u4e0d\u6861\u4e4e\u4e0b\u4e5f\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u9686\uff0c\u9ad8\u8038\u3002\u8fd9\u91cc\u4e3a\u633a\u76f4\u4e4b\u610f\u3002\u2461\u5b83\uff0c\u53e4\u8bed\u8c13\u610f\u5916\u4e4b\u60a3\u4e3a\u5b83\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u56db\uff1a\u5c4b\u6881\u633a\u76f4\uff0c\u5409\u5229\u3002\u4f46\u6709\u610f\u5916\u4e4b\u60a3\u5219\u4e0d\u597d\u5e94\u4ed8\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5c4b\u6881\u633a\u76f4\u4e4b\u6240\u4ee5\u5409\u5229\uff0c\u56e0\u4e3a\u5c4b\u6881\u4e0d\u5f2f\u66f2\u5219\u623f\u5c4b\u4e0d\u503e\u5012\u3002\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e94\uff1a\u67af\u6768\u751f\u534e\uff0c\u8001\u5987\u5f97\u5176\u58eb\u592b\uff0c\u65e0\u548e\u65e0\u8a89\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u67af\u6768\u751f\u534e\uff0c\u4f46\u53ef\u4e45\u4e5f\u3002\u8001\u5987\u571f\u592b\uff0c\u4ea6\u53ef\u4e11\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e94\uff1a\u67af\u6768\u5f00\u82b1\uff0c\u8001\u5987\u4eba\u5ac1\u7ed9\u4e00\u4e2a\u5e74\u8f7b\u4eba\uff0c\u8fd9\u4ef6\u4e8b\u4e0d\u597d\u4e5f\u4e0d\u574f\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u67af\u6768\u5f00\u82b1\uff0c\u5176\u82b1\u600e\u80fd\u957f\u5f00\u4e0d\u8c22\u3002\u8001\u5987\u4eba\u5ac1\u7ed9\u5e74\u8f7b\u4eba\uff0c\u8fd9\u79cd\u4e8b\u603b\u4e0d\u5927\u5149\u5f69\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u516d\uff1a\u8fc7\u6d89\u706d\u9876\u2460\uff0c\u51f6\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u8fc7\u6d89\u4e4b\u51f6\uff0c\u4e0d\u53ef\u65e0\u548e\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u516d\uff1a\u76f2\u76ee\u6d89\u6c34\uff0c\u6c34\u6df1\u8fc7\u9876\uff0c\u867d\u9047\u51f6\u9669\uff0c\u4f46\u7ec8\u5f52\u6ca1\u6709\u707e\u96be\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u76f2\u76ee\u6d89\u6c34\u906d\u81f4\u5371\u9669\uff0c\u4e8b\u5df2\u81f3\u6b64\uff0c\u8c34\u8d23\u4ea6\u5c5e\u65e0\u76ca\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u8fc7\uff0c\u9519\uff0c\u76f2\u76ee\u3002\u6d89\uff0c\u5f92\u6b65\u6d89\u6c34\u3002\n    "))
