s.push(new K.R(r,r,"\u574e\u4e3a\u6c34","\u3010\u539f\u6587\u3011 \u4e60\u574e\u2460\u3002\u6709\u5b5a\uff0c\u7ef4\u5fc3\uff0c\u4ea8\u3002\u884c\u6709\u5c1a\u2461\u3002\n\u3010\u8bd1\u6587\u3011 \u4e60\u574e\u5366\u3002\u6293\u83b7\u4fd8\u864f\uff0c\u529d\u6170\u5b89\u629a\u4ed6\u4eec\uff0c\u901a\u6cf0\u3002\u9014\u4e2d\u5c06\u5f97\u5230\u5e2e\u52a9\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u4e60\u574e\uff0c\u5366\u540d\u3002\u672c\u5366\u4e3a\u540c\u5366\u76f8\u53e0(\u574e\u4e0a\u574e\u4e0b)\u3002\u4e24\u574e\u76f8\u91cd\uff0c\u574e\u4e3a\u9669\u4e3a\u6c34\uff0c\u53ef\u89c1\u5176\u5366\u8c61\u4e3a\u91cd\u91cd\u9669\u963b\uff0c\u53c8\u50cf\u6c34\u957f\u6d41\u4e0d\u606f\u3002\u6240\u4ee5\u5366\u540d\u76ee\u4e60\u574e\u3002\u4e60\uff0c\u5b54\u9896\u8fbe\u8bf4\uff1a\u201c\u4e60\uff0c\u91cd\u4e5f\u3002\u201d\u2461\u5b5a\uff0c\u53e4\u4fd8\u5b57\u3002\u7ef4\uff0c\u7ef4\u7cfb\u3002\u7ef4\u5fc3\uff0c\u529d\u6170\u4eba\u5fc3\u3002\u884c\uff0c\u8fd9\u91cc\u6307\u8def\u9014\u3002\u5c1a\uff0c\u5e2e\u52a9\u3002\u300a\u5f56\u8f9e\u300b\u89e3\u201c\u7ef4\u201d\u5982\u60df\uff0c\u7528\u6cd5\u540c\u5176\u3002\u89e3\u201c\u5c1a\u201d\u4e3a\u8d4f\u3002\u7686\u4e0e\u7ecf\u610f\u6709\u51fa\u5165\u3002\n\n\u3010\u539f\u6587\u3011 \u300a\u5f56\u300b\u66f0\uff1a\u4e60\u574e\uff0c\u91cd\u9669\u4e5f\u2460\u3002\u6c34\u6d41\u800c\u4e0d\u76c8\u2461\u3002\u884c\u9669\u800c\u4e0d\u5931\u5176\u4fe1\uff0c\u7ef4\u5fc3\u4ea8\uff0c\u4e43\u4ee5\u521a\u4e2d\u4e5f\u3002\u201c\u884c\u6709\u5c1a\u201d\uff0c\u5f80\u6709\u529f\u4e5f\u3002\u5929\u9669\uff0c\u4e0d\u53ef\u5347\u4e5f\u3002\u5730\u9669\uff0c\u5c71\u5ddd\u4e18\u9675\u4e5f\u3002\u738b\u516c\u8bbe\u9669\uff0c\u4ee5\u5b88\u5176\u56fd\u3002\u9669\u4e4b\u65f6\uff0c\u7528\u5927\u77e3\u54c9\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u5f56\u8f9e\u300b\u8bf4\uff1a\u4e60\u574e\uff0c\u5c31\u662f\u6307\u9669\u963b\u76f8\u91cd\u3002\u53c8\u6307\u6c34\u957f\u6d41\u800c\u4e0d\u505c\u84c4\u3002\u574e\u4e3a\u9669\uff0c\u4eba\u884c\u9669\u9053\u800c\u4e0d\u8fdd\u5176\u4fe1\u8bfa\uff0c\u53ef\u89c1\u5176\u5fc3\u4ea8\u7f8e\uff0c\u56e0\u4e3a\u723b\u8c61\u8868\u660e\uff0c\u4e5d\u4e8c\u3001\u4e5d\u4e94\u4e4b\u723b\u5c45\u4e0b\u5366\u3001\u4e0a\u5366\u4e4b\u4e2d\u4f4d\uff0c\u50cf\u4eba\u6709\u521a\u5065\u4e2d\u6b63\u4e4b\u5fb7\u3002\u5176\u79c9\u5fc3\u5982\u6b64\uff0c\u201c\u6240\u884c\u5fc5\u83b7\u8d4f\u201d\uff0c\u6240\u5f80\u5fc5\u6709\u529f\u3002\u5929\u4e4b\u9669\uff0c\u5728\u4e8e\u65e0\u9636\u53ef\u5347\uff0c\u5730\u4e4b\u9669\uff0c\u5728\u4e8e\u5c71\u5ddd\u4ea4\u9519\uff0c\u4e18\u9675\u8d77\u4f0f\u3002\u738b\u516c\u9ad8\u7b51\u57ce\u90ed\uff0c\u6df1\u6316\u58d5\u5811\uff0c\u8bbe\u7f6e\u9669\u963b\uff0c\u5176\u610f\u5728\u4e8e\u4fdd\u536b\u56fd\u5bb6\u7684\u5b89\u5168\u3002\u5173\u5c71\u9669\u963b\uff0c\u5728\u5173\u952e\u7684\u65f6\u523b\u6240\u53d1\u6325\u7684\u4f5c\u7528\u662f\u5de8\u5927\u7684\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u91cd\u9669\uff0c\u574e\u4e3a\u9669\uff0c\u4e24\u574e\u76f8\u91cd\uff0c\u6545\u8c13\u91cd\u9669\u3002\u2461\u6c34\u6d41\u800c\u4e0d\u76c8\uff0c\u574e\u4e3a\u6c34\uff0c\u4e24\u574e\u76f8\u91cd\uff0c\u8c13\u6c34\u957f\u6d41\u4e0d\u606f\u3002\u76c8\uff0c\u505c\u6ede\uff0c\u505c\u84c4\u3002\n\u3010\u539f\u6587\u3011 \u300a\u8c61\u300b\u66f0\uff1a\u6c34\u6d0a\u81f3\uff0c\u4e60\u574e\u2460\u3002\u541b\u5b50\u4ee5\u5e38\u5fb7\u884c\uff0c\u4e60\u6559\u4e8b\u2461\u3002\n\u3010\u8bd1\u6587\u3011 \u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u574e\u4e3a\u6c38\uff0c\u6c34\u957f\u6d41\u4e0d\u6ede\uff0c\u662f\u574e\u5366\u7684\u5366\u8c61\u3002\u541b\u5b50\u89c2\u6b64\u5366\u8c61\uff0c\u4ece\u800c\u5c0a\u5c1a\u5fb7\u884c\uff0c\u53d6\u6cd5\u4e8e\u7ec6\u6c34\u957f\u6d41\u4e4b\u8c61\uff0c\u5b66\u4e60\u6559\u5316\u4eba\u6c11\u7684\u65b9\u6cd5\u3002\n\u3010\u6ce8\u91ca\u3011 \u2460\u6d0a(ji\xe0n)\uff0c\u300a\u96c6\u89e3\u300b\u5f15\u9646\u7ee9\u66f0\uff1a\u201c\u6d0a\uff0c\u518d\u4e5f\u3002\u201d\u2461\u5e38\uff0c\u5f53\u8bfb\u4e3a\u5c1a\uff0c\u5c0a\u5c1a\u3002\n\u3010\u539f\u6587\u3011\n\u521d\u516d\uff1a\u4e60\u574e\uff0c\u5165\u4e8e\u574e\u7a9e\u2460\uff0c\u51f6\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4e60\u574e\u5165\u574e\uff0c\u5931\u9053\u51f6\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u521d\u516d\uff1a\u574e\u5751\u4e4b\u4e2d\u53c8\u6709\u574e\u5751\uff0c\u9677\u5165\u91cd\u5751\u4e4b\u4e2d\uff0c\u51f6\u9669\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u201c\u574e\u5751\u4e4b\u4e2d\u53c8\u6709\u574e\u5751\uff0c\u9677\u5165\u91cd\u5751\u5f53\u4e2d\u201d\uff0c\u4e0d\u884c\u5766\u9014\uff0c\u504f\u8981\u8d70\u9669\u9053\uff0c\u5fc5\u62db\u81f4\u707e\u6b83\u3002\n\u3010\u6ce8\u91ca\u3011 \u4e60\u574e\uff0c\u72b9\u8a00\u91cd\u574e\uff0c\u610f\u601d\u662f\u574e\u5751\u4e4b\u4e2d\u53c8\u6709\u574e\u5751\u3002\u7a9e(d\xe0n\u65e6)\uff0c\u674e\u955c\u6c60\u8bf4\uff1a\u201c\u50cf\u4eba\u5728\u4e24\u574e\u4e4b\u4e2d\uff0c\u4e0a\u7a74\u4e0b\u81fc\uff0c\u7a74\u81fc\u90fd\u662f\u574e\u5751\u3002\u201d\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e8c\uff1a\u574e\u6709\u9669\uff0c\u6c42\u5c0f\u5f97\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u6c42\u5c0f\u5f97\uff0c\u672a\u51fa\u4e2d\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e8c\uff1a\u5751\u5751\u574e\u574e\uff0c\u9053\u6709\u9669\u963b\u3002\u6562\u4e8e\u884c\u9669\u9053\uff0c\u6216\u5c0f\u6709\u6536\u83b7\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u6562\u4e8e\u884c\u9669\u9053\uff0c\u6216\u5c0f\u6709\u6536\u83b7\uff0c\u56e0\u4e3a\u4e5d\u4e8c\u4e4b\u723b\u5c45\u4e0b\u5366\u7684\u4e2d\u4f4d\uff0c\u50cf\u4eba\u5c1a\u672a\u504f\u79bb\u6b63\u9053\u3002\n\u3010\u539f\u6587\u3011\n\u516d\u4e09\uff1a\u6765\u4e4b\u574e\u2460\uff0c\u574e\u9669\u4e14\u6795\u2461\u3002\u5165\u4e8e\u574e\u7a9e\uff0c\u52ff\u7528\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u6765\u4e4b\u574e\u574e\uff0c\u7ec8\u65e0\u529f\u4e5f\u3002 \n\u3010\u8bd1\u6587\u3011\n\u516d\u4e09\uff1a\u5411\u5751\u574e\u8d70\u6765\uff0c\u8fd9\u5751\u574e\u65e2\u9669\u53c8\u6df1\uff0c\u9677\u5165\u91cd\u574e\u4e4b\u4e2d\uff0c\u975e\u5e38\u4e0d\u5229\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u6765\u5230\u8fd9\u591a\u574e\u4e4b\u5730\uff0c\u7ec8\u65e0\u529f\u5229\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u4e4b\uff0c\u52a8\u8bcd\uff0c\u4e49\u8fd1\u4e8e\u6765\u3002\u8d70\u5411\u3002\u2461\u6795\uff0c\u53e4\u6587\u4f5c\u6c88(\u300a\u91ca\u6587\u300b)\u3002\u300a\u5e84\u5b50?\u5916\u7269\u300b\uff1a\u201c\u6170\u776f\u6c88\u5c6f\u201d\uff0c\u8bad\u6c88\u4e3a\u6df1\u3002\n\n\u3010\u539f\u6587\u3011\n\u516d\u56db\uff1a\u6a3d\u9152\u2460\u7c0b\u8d30\u2461\u3002\u7528\u7f36\uff0c\u7eb3\u7ea6\u81ea\u7257\u2462\u3002\u7ec8\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u6a3d\u9152\u7c0b\u8d30\uff0c\u521a\u67d4\u9645\u4e5f\u2463\u3002\n\u3010\u8bd1\u6587\u3011\n\u516d\u56db\uff1a\u7528\u94dc\u6a3d\u76db\u9152\uff0c\u7528\u5706\u7c0b\u76db\u996d\u3002\u7136\u800c\u5bf9\u4e8e\u5173\u62bc\u5728\u574e\u7a96\u91cc\u7684\u72af\u4eba\uff0c\u53ea\u987b\u7528\u74e6\u76c6\u5b50\u5c31\u884c\u4e86\uff0c\u7262\u996d\u4ece\u5929\u7a97\u91cc\u9001\u8fdb\u53d6\u51fa\uff0c\u5176\u4eba\u906d\u6b64\u5669\u8fd0\uff0c\u4f46\u6700\u540e\u8fd8\u662f\u6ca1\u6709\u5371\u9669\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u201c\u5e73\u65f6\u4eab\u53d7\u7f8e\u98df\u7f8e\u5668\uff0c\u6b64\u65f6\u7528\u74e6\u76c6\u5b50\u5403\u7262\u996d\u201d\uff0c\u723b\u8c61\u8868\u660e\u516d\u56db\u9634\u723b\u5904\u4e8e\u4e5d\u4e94\u9633\u723b\u4e4b\u535e\uff0c\u50cf\u4eba\u88ab\u5f3a\u8005\u6240\u538b\uff0c\u53d7\u6b64\u78e8\u96be\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u6a3d\uff0c\u76db\u9152\u7684\u5668\u76bf\uff0c\u9152\u58f6\u3002\u2461\u7c0b(gu\u01d0\u9b3c)\uff0c\u76db\u996d\u7684\u5668\u76bf\uff0c\u996d\u76d2\u3002\u8d30\uff0c\u5f53\u4f5c\u8d44\uff0c\u5f62\u4f3c\u800c\u8bef\u3002\u8d44\uff0c\u501f\u4e3a\u7ca2\uff0c\u7c73\u996d\u3002 \u2462\u7eb3\uff0c\u95fb\u4e00\u591a\u8bf4\uff1a\u201c\u72b9\u53d6\u4e5f\u3002\u201d\u53c8\u8bf4\uff1a\u201c\u9152\u98df\u800c\u5fc5\u767d\u7256\u7eb3\u53d6\u4e4b\u8005\uff0c\u76d6\u4ea6\u5c31\u5728\u72f1\u8005\u8a00\u4e4b\u3002\u201d\u7256\uff0c\u7a97\u3002\u2463\u9645\uff0c\u4ea4\u52a0\uff0c\u4ea4\u63a5\u3002\u521a\u67d4\u9645\uff0c\u6b64\u4ee5\u516d\u56db\u3001\u4e5d\u4e94\u723b\u8c61\u723b\u4f4d\u4e3a\u636e\u3002\n\n\u3010\u539f\u6587\u3011\n\u4e5d\u4e94\uff1a\u574e\u4e0d\u76c8\uff0c\u7957\u65e2\u5e73\u2460\uff0c\u65e0\u548e\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u574e\u4e0d\u76c8\uff0c\u4e2d\u672a\u5927\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e5d\u4e94\uff1a\u574e\u5751\u867d\u6ca1\u6709\u586b\u6ee1\uff0c\u5c0f\u5c71\u5934\u5374\u88ab\u9504\u5e73\u3002\u6ca1\u6709\u707e\u96be\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u5c0f\u5c71\u5934\u867d\u9504\u5e73\uff0c\u4f46\u574e\u5751\u5c1a\u672a\u586b\u6ee1\uff0c\u8bf4\u660e\u9053\u8def\u4e0d\u5e73\uff0c\u672a\u6210\u5766\u9014\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u7957\uff0c\u300a\u91ca\u6587\u300b\uff1a\u201c\u90d1\u4e91\uff1a \u2018\u5f53\u4e3a\u577b\uff0c\u5c0f\u4e18\u4e5f\u3002\u2019\u201d\n\n\u3010\u539f\u6587\u3011\n\u4e0a\u516d\uff1a\u7cfb\u7528\u5fbd\u7e86\u2460\uff0c\u5bd8\u4e8e\u4e1b\u68d8\u2461\uff0c\u4e09\u5c81\u4e0d\u5f97\uff0c\u51f6\u3002\n\u300a\u8c61\u300b\u66f0\uff1a\u4e0a\u516d\u5931\u9053\uff0c\u51f6\u4e09\u5c81\u4e5f\u3002\n\u3010\u8bd1\u6587\u3011\n\u4e0a\u516d\uff1a\u628a\u72af\u4eba\u7528\u7ef3\u7d22\u6346\u7d27\uff0c\u6295\u5165\u5468\u56f4\u6709\u4e1b\u68d8\u7684\u76d1\u72f1\u4e2d\uff0c\u4e09\u5e74\u4e0d\u5f97\u91ca\u653e\uff0c\u8fd9\u662f\u51f6\u8138\u4e4b\u4e8b\u3002\n\u300a\u8c61\u8f9e\u300b\u8bf4\uff1a\u4e0a\u516d\u723b\u8f9e\u6240\u63cf\u8ff0\u7684\uff0c\u6b63\u8bf4\u660e\u5b98\u540f\u8fdd\u80cc\u6b63\u9053\uff0c\u8fdd\u6cd5\u56da\u4eba\uff0c\u5386\u65f6\u4e09\u5e74\u4e4b\u4e45\u3002\n\u3010\u6ce8\u91ca\u3011\n\u2460\u7cfb\uff0c\u6346\u7ed1\u3002\u5fbd\u7e86\uff0c\u6c99\u5c11\u6d77\u5148\u751f\u8bf4\uff1a\u300a\u91ca\u6587\u300b\uff1a\u5218\u4e91\uff1a\u2018\u4e09\u80a1\u66f0\u5fbd\uff0c\u4e24\u80a1\u66f0\u7e86\uff0c\u7686\u7d22\u540d\u3002\u2019\u201d\u2461\u4e1b\u68d8\uff0c\u6307\u76d1\u72f1\u3002\u53e4\u4ee3\u72f1\u5916\uff0c\u56f4\u79cd\u4e1b\u68d8\uff0c\u4ee5\u9632\u56da\u72af\u9003\u7a9c\uff0c\u6545\u4e1b\u68d8\u6307\u4ee3\u76d1\u72f1\u3002\u5bd8\uff0c\u5373\u7f6e\u3002\n    "))
